  <script type="application/json" data-target="react-app.embeddedData">{"payload":{"allShortcutsEnabled":false,"fileTree":{"":{"items":[{"name":".github","path":".github","contentType":"directory"},{"name":"ADRecon.ps1","path":"ADRecon.ps1","contentType":"file"},{"name":"LICENSE.md","path":"LICENSE.md","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"}],"totalCount":4}},"fileTreeProcessingTime":2.150951,"foldersToFetch":[],"repo":{"id":161905307,"defaultBranch":"master","name":"ADRecon","ownerLogin":"adrecon","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2018-12-15T13:00:09.000Z","ownerAvatar":"https://avatars.githubusercontent.com/u/44988866?v=4","public":true,"private":false,"isOrgOwned":true},"codeLineWrapEnabled":false,"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"master","listCacheKey":"v0:1613518746.510466","canEdit":false,"refType":"branch","currentOid":"3a9f90cc7414bd6479d5a8439d5abe76029251b9"},"path":"ADRecon.ps1","currentUser":null,"blob":{"rawLines":["﻿\u003c#","",".SYNOPSIS","","    ADRecon is a tool which gathers information about the Active Directory and generates a report which can provide a holistic picture of the current state of the target AD environment.","",".DESCRIPTION","","    ADRecon is a tool which extracts and combines various artefacts (as highlighted below) out of an AD environment. The information can be presented in a specially formatted Microsoft Excel report that includes summary views with metrics to facilitate analysis and provide a holistic picture of the current state of the target AD environment.","    The tool is useful to various classes of security professionals like auditors, DFIR, students, administrators, etc. It can also be an invaluable post-exploitation tool for a penetration tester.","    It can be run from any workstation that is connected to the environment, even hosts that are not domain members. Furthermore, the tool can be executed in the context of a non-privileged (i.e. standard domain user) account.","    Fine Grained Password Policy, LAPS and BitLocker may require Privileged user accounts.","    The tool will use Microsoft Remote Server Administration Tools (RSAT) if available, otherwise it will communicate with the Domain Controller using LDAP.","    The following information is gathered by the tool:","    * Forest;","    * Domain;","    * Trusts;","    * Sites;","    * Subnets;","    * Schema History;","    * Default and Fine Grained Password Policy (if implemented);","    * Domain Controllers, SMB versions, whether SMB Signing is supported and FSMO roles;","    * Users and their attributes;","    * Service Principal Names (SPNs);","    * Groups, memberships and changes;","    * Organizational Units (OUs);","    * GroupPolicy objects and gPLink details;","    * DNS Zones and Records;","    * Printers;","    * Computers and their attributes;","    * PasswordAttributes (Experimental);","    * LAPS passwords (if implemented);","    * BitLocker Recovery Keys (if implemented);","    * ACLs (DACLs and SACLs) for the Domain, OUs, Root Containers, GPO, Users, Computers and Groups objects (not included in the default collection method);","    * GPOReport (requires RSAT);","    * Kerberoast (not included in the default collection method); and","    * Domain accounts used for service accounts (requires privileged account and not included in the default collection method).","","    Author     : Prashant Mahajan","",".NOTES","","    The following commands can be used to turn off ExecutionPolicy: (Requires Admin Privs)","","    PS \u003e $ExecPolicy = Get-ExecutionPolicy","    PS \u003e Set-ExecutionPolicy bypass","    PS \u003e .\\ADRecon.ps1","    PS \u003e Set-ExecutionPolicy $ExecPolicy","","    OR","","    Start the PowerShell as follows:","    powershell.exe -ep bypass","","    OR","","    Already have a PowerShell open ?","    PS \u003e $Env:PSExecutionPolicyPreference = 'Bypass'","","    OR","","    powershell.exe -nologo -executionpolicy bypass -noprofile -file ADRecon.ps1","",".PARAMETER Method","\tWhich method to use; ADWS (default), LDAP","",".PARAMETER DomainController","\tDomain Controller IP Address or Domain FQDN.","",".PARAMETER Credential","\tDomain Credentials.","",".PARAMETER GenExcel","\tPath for ADRecon output folder containing the CSV files to generate the ADRecon-Report.xlsx. Use it to generate the ADRecon-Report.xlsx when Microsoft Excel is not installed on the host used to run ADRecon.","",".PARAMETER OutputDir","\tPath for ADRecon output folder to save the files and the ADRecon-Report.xlsx. (The folder specified will be created if it doesn't exist)","",".PARAMETER Collect","    Which modules to run; Comma separated; e.g Forest,Domain (Default all except Kerberoast, DomainAccountsusedforServiceLogon)","    Valid values include: Forest, Domain, Trusts, Sites, Subnets, SchemaHistory, PasswordPolicy, FineGrainedPasswordPolicy, DomainControllers, Users, UserSPNs, PasswordAttributes, Groups, GroupChanges, GroupMembers, OUs, GPOs, gPLinks, DNSZones, DNSRecords, Printers, Computers, ComputerSPNs, LAPS, BitLocker, ACLs, GPOReport, Kerberoast, DomainAccountsusedforServiceLogon.","",".PARAMETER OutputType","    Output Type; Comma seperated; e.g STDOUT,CSV,XML,JSON,HTML,Excel (Default STDOUT with -Collect parameter, else CSV and Excel).","    Valid values include: STDOUT, CSV, XML, JSON, HTML, Excel, All (excludes STDOUT).","",".PARAMETER DormantTimeSpan","    Timespan for Dormant accounts. (Default 90 days)","",".PARAMETER PassMaxAge","    Maximum machine account password age. (Default 30 days)","",".PARAMETER PageSize","    The PageSize to set for the LDAP searcher object.","",".PARAMETER Threads","    The number of threads to use during processing objects. (Default 10)","",".PARAMETER OnlyEnabled","    Only collect details for enabled objects. (Default $false)","",".PARAMETER Log","    Create ADRecon Log using Start-Transcript","",".PARAMETER Logo","    Which Logo to use in the excel file? (Default ADRecon)","    Values include ADRecon, CyberCX, Payatu.","",".EXAMPLE","","\t.\\ADRecon.ps1 -GenExcel C:\\ADRecon-Report-\u003ctimestamp\u003e","    [*] ADRecon \u003cversion\u003e by Prashant Mahajan (@prashant3535)","    [*] Generating ADRecon-Report.xlsx","    [+] Excelsheet Saved to: C:\\ADRecon-Report-\u003ctimestamp\u003e\\\u003cdomain\u003e-ADRecon-Report.xlsx","",".EXAMPLE","","\t.\\ADRecon.ps1 -DomainController \u003cIP or FQDN\u003e -Credential \u003cdomain\\username\u003e","    [*] ADRecon \u003cversion\u003e by Prashant Mahajan (@prashant3535)","\t[*] Running on \u003cdomain\u003e\\\u003chostname\u003e - Member Workstation as \u003cuser\u003e","    \u003csnip\u003e","","    Example output from Domain Member with Alternate Credentials.","",".EXAMPLE","","\t.\\ADRecon.ps1 -DomainController \u003cIP or FQDN\u003e -Credential \u003cdomain\\username\u003e -Collect DomainControllers -OutputType Excel","    [*] ADRecon \u003cversion\u003e by Prashant Mahajan (@prashant3535)","    [*] Running on WORKGROUP\\\u003chostname\u003e - Standalone Workstation as \u003cuser\u003e","    [*] Commencing - \u003ctimestamp\u003e","    [-] Domain Controllers","    [*] Total Execution Time (mins): \u003cminutes\u003e","    [*] Generating ADRecon-Report.xlsx","    [+] Excelsheet Saved to: C:\\ADRecon-Report-\u003ctimestamp\u003e\\\u003cdomain\u003e-ADRecon-Report.xlsx","    [*] Completed.","    [*] Output Directory: C:\\ADRecon-Report-\u003ctimestamp\u003e","","    Example output from from a Non-Member using RSAT to only enumerate Domain Controllers.","",".EXAMPLE","","    .\\ADRecon.ps1 -Method ADWS -DomainController \u003cIP or FQDN\u003e -Credential \u003cdomain\\username\u003e","    [*] ADRecon \u003cversion\u003e by Prashant Mahajan (@prashant3535)","    [*] Running on WORKGROUP\\\u003chostname\u003e - Standalone Workstation as \u003cuser\u003e","    [*] Commencing - \u003ctimestamp\u003e","    [-] Domain","    [-] Forest","    [-] Trusts","    [-] Sites","    [-] Subnets","    [-] SchemaHistory - May take some time","    [-] Default Password Policy","    [-] Fine Grained Password Policy - May need a Privileged Account","    [-] Domain Controllers","    [-] Users and SPNs - May take some time","    [-] PasswordAttributes - Experimental","    [-] Groups and Membership Changes - May take some time","    [-] Group Memberships - May take some time","    [-] OrganizationalUnits (OUs)","    [-] GPOs","    [-] gPLinks - Scope of Management (SOM)","    [-] DNS Zones and Records","    [-] Printers","    [-] Computers and SPNs - May take some time","    [-] LAPS - Needs Privileged Account","    WARNING: [*] LAPS is not implemented.","    [-] BitLocker Recovery Keys - Needs Privileged Account","    [-] GPOReport - May take some time","    WARNING: [*] Run the tool using RUNAS.","    WARNING: [*] runas /user:\u003cDomain FQDN\u003e\\\u003cUsername\u003e /netonly powershell.exe","    [*] Total Execution Time (mins): \u003cminutes\u003e","    [*] Output Directory: C:\\ADRecon-Report-\u003ctimestamp\u003e","    [*] Generating ADRecon-Report.xlsx","    [+] Excelsheet Saved to: C:\\ADRecon-Report-\u003ctimestamp\u003e\\\u003cdomain\u003e-ADRecon-Report.xlsx","","    Example output from a Non-Member using RSAT.","",".EXAMPLE","","    .\\ADRecon.ps1 -Method LDAP -DomainController \u003cIP or FQDN\u003e -Credential \u003cdomain\\username\u003e","    [*] ADRecon \u003cversion\u003e by Prashant Mahajan (@prashant3535)","    [*] Running on WORKGROUP\\\u003chostname\u003e - Standalone Workstation as \u003cuser\u003e","    [*] LDAP bind Successful","    [*] Commencing - \u003ctimestamp\u003e","    [-] Domain","    [-] Forest","    [-] Trusts","    [-] Sites","    [-] Subnets","    [-] SchemaHistory - May take some time","    [-] Default Password Policy","    [-] Fine Grained Password Policy - May need a Privileged Account","    [-] Domain Controllers","    [-] Users and SPNs - May take some time","    [-] Passwor