ated if it doesn't exist)\")]","    [string] $OutputDir,","","    [Parameter(Mandatory = $false, HelpMessage = \"Which modules to run; Comma separated; e.g Forest,Domain (Default all except ACLs, Kerberoast and DomainAccountsusedforServiceLogon) Valid values include: Forest, Domain, Trusts, Sites, Subnets, SchemaHistory, PasswordPolicy, FineGrainedPasswordPolicy, DomainControllers, Users, UserSPNs, PasswordAttributes, Groups, GroupChanges, GroupMembers, OUs, GPOs, gPLinks, DNSZones, DNSRecords, Printers, Computers, ComputerSPNs, LAPS, BitLocker, ACLs, GPOReport, Kerberoast, DomainAccountsusedforServiceLogon\")]","    [ValidateSet('Forest', 'Domain', 'Trusts', 'Sites', 'Subnets', 'SchemaHistory', 'PasswordPolicy', 'FineGrainedPasswordPolicy', 'DomainControllers', 'Users', 'UserSPNs', 'PasswordAttributes', 'Groups', 'GroupChanges', 'GroupMembers', 'OUs', 'GPOs', 'gPLinks', 'DNSZones', 'DNSRecords', 'Printers', 'Computers', 'ComputerSPNs', 'LAPS', 'BitLocker', 'ACLs', 'GPOReport', 'Kerberoast', 'DomainAccountsusedforServiceLogon', 'Default')]","    [array] $Collect = 'Default',","","    [Parameter(Mandatory = $false, HelpMessage = \"Output type; Comma seperated; e.g STDOUT,CSV,XML,JSON,HTML,Excel (Default STDOUT with -Collect parameter, else CSV and Excel)\")]","    [ValidateSet('STDOUT', 'CSV', 'XML', 'JSON', 'EXCEL', 'HTML', 'All', 'Default')]","    [array] $OutputType = 'Default',","","    [Parameter(Mandatory = $false, HelpMessage = \"Timespan for Dormant accounts. Default 90 days\")]","    [ValidateRange(1,1000)]","    [int] $DormantTimeSpan = 90,","","    [Parameter(Mandatory = $false, HelpMessage = \"Maximum machine account password age. Default 30 days\")]","    [ValidateRange(1,1000)]","    [int] $PassMaxAge = 30,","","    [Parameter(Mandatory = $false, HelpMessage = \"The PageSize to set for the LDAP searcher object. Default 200\")]","    [ValidateRange(1,10000)]","    [int] $PageSize = 200,","","    [Parameter(Mandatory = $false, HelpMessage = \"The number o