"        {","            ZERO = 0,","            DES_CBC_CRC = 1,        // 0x1","            DES_CBC_MD5 = 2,        // 0x2","            RC4_HMAC = 4,        // 0x4","            AES128_CTS_HMAC_SHA1_96 = 8,       // 0x18","            AES256_CTS_HMAC_SHA1_96 = 16       // 0x10","        }","","\t\tprivate static readonly Dictionary\u003cstring, string\u003e Replacements = new Dictionary\u003cstring, string\u003e()","        {","            //{System.Environment.NewLine, \"\"},","            //{\",\", \";\"},","            {\"\\\"\", \"'\"}","        };","","        public static string CleanString(Object StringtoClean)","        {","            // Remove extra spaces and new lines","            string CleanedString = string.Join(\" \", ((Convert.ToString(StringtoClean)).Split((string[]) null, StringSplitOptions.RemoveEmptyEntries)));","            foreach (string Replacement in Replacements.Keys)","            {","                CleanedString = CleanedString.Replace(Replacement, Replacements[Replacement]);","            }","            return CleanedString;","        }","","        public static int ObjectCount(Object[] ADRObject)","        {","            return ADRObject.Length;","        }","","        public static Object[] DomainControllerParser(Object[] AdDomainControllers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdDomainControllers, numOfThreads, \"DomainControllers\");","            return ADRObj;","        }","","        public static Object[] SchemaParser(Object[] AdSchemas, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdSchemas, numOfThreads, \"SchemaHistory\");","            return ADRObj;","        }","","        public static Object[] UserParser(Object[] AdUsers, DateTime Date1, int DormantTimeSpan, int PassMaxAge, int numOfThreads)","        {","            ADWSClass.Date1 = Date1;","            ADWSClass.DormantTimeSpan = DormantTimeSpan;","            ADWSClass.PassMaxAge = PassMaxAge;","","            Object[] ADRObj = runProcessor(AdUsers, numOfThreads, \"Users\");","            return ADRObj;","        }","","        public static Object[] UserSPNParser(Object[] AdUsers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdUsers, numOfThreads, \"UserSPNs\");","            return ADRObj;","        }","","        public static Object[] GroupParser(Object[] AdGroups, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdGroups, numOfThreads, \"Groups\");","            return ADRObj;","        }","","        public static Object[] GroupChangeParser(Object[] AdGroups, DateTime Date1, int numOfThreads)","        {","            ADWSClass.Date1 = Date1;","            Object[] ADRObj = runProcessor(AdGroups, numOfThreads, \"GroupChanges\");","            return ADRObj;","        }","","        public static Object[] GroupMemberParser(Object[] AdGroups, Object[] AdGroupMembers, string DomainSID, int numOfThreads)","        {","            ADWSClass.AdGroupDictionary = new Dictionary\u003cstring, string\u003e();","            runProcessor(AdGroups, numOfThreads, \"GroupsDictionary\");","            ADWSClass.DomainSID = DomainSID;","            Object[] ADRObj = runProcessor(AdGroupMembers, numOfThreads, \"GroupMembers\");","            return ADRObj;","        }","","        public static Object[] OUParser(Object[] AdOUs, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdOUs, numOfThreads, \"OUs\");","            return ADRObj;","        }","","        public static Object[] GPOParser(Object[] AdGPOs, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdGPOs, numOfThreads, \"GPOs\");","            return ADRObj;","        }","","        public static Object[] SOMParser(Object[] AdGPOs, Object[] AdSOMs, int numOfThreads)","        {","            ADWSClass.AdGPODictionary = new Dictionary\u003cstring, string\u003e();","            runProcessor(AdGPOs, numOfThreads, \"GPOsDictionary\");","            Object[] ADRObj = runProcessor(AdSOMs, numOfThreads, \"SOMs\");","            return ADRObj;","        }","","        public static Object[] PrinterParser(Object[] ADPrinters, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(ADPrinters, numOfThreads, \"Printers\");","            return ADRObj;","        }","","        public static Object[] ComputerParser(Object[] AdComputers, DateTime Date1, int DormantTimeSpan, int PassMaxAge, int numOfThreads)","        {","            ADWSClass.Date1 = Date1;","            ADWSClass.DormantTimeSpan = DormantTimeSpan;","            ADWSClass.PassMaxAge = PassMaxAge;","","            Object[] ADRObj = runProcessor(AdComputers, numOfThreads, \"Computers\");","            return ADRObj;","        }","","        public static Object[] ComputerSPNParser(Object[] AdComputers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdComputers, numOfThreads, \"ComputerSPNs\");","            return ADRObj;","        }","","        public static Object[] LAPSParser(Object[] AdComputers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdComputers, numOfThreads, \"LAPS\");","            return ADRObj;","        }","","        public static Object[] DACLParser(Object[] ADObjects, Object PSGUIDs, int numOfThreads)","        {","            ADWSClass.AdSIDDictionary = new Dictionary\u003cstring, string\u003e();","            runProcessor(ADObjects, numOfThreads, \"SIDDictionary\");","            ADWSClass.GUIDs = (Hashtable) PSGUIDs;","            Object[] ADRObj = runProcessor(ADObjects, numOfThreads, \"DACLs\");","            return ADRObj;","        }","","        public static Object[] SACLParser(Object[] ADObjects, Object PSGUIDs, int numOfThreads)","        {","            ADWSClass.GUIDs = (Hashtable) PSGUIDs;","            Object[] ADRObj = runProcessor(ADObjects, numOfThreads, \"SACLs\");","            return ADRObj;","        }","","        static Object[] runProcessor(Object[] arrayToProcess, int numOfThreads, string processorType)","        {","            int totalRecords = arrayToProcess.Length;","            IRecordProcessor recordProcessor = recordProcessorFactory(processorType);","            IResultsHandler resultsHandler = new SimpleResultsHandler ();","            int numberOfRecordsPerThread = totalRecords / numOfThreads;","            int remainders = totalRecords % numOfThreads;","","            Thread[] threads = new Thread[numOfThreads];","            for (int i = 0; i \u003c numOfThreads; i++)","            {","                int numberOfRecordsToProcess = numberOfRecordsPerThread;","                if (i == (numOfThreads - 1))","                {","                    //last thread, do the remaining records","                    numberOfRecordsToProcess += remainders;","                }","","                //split the full array into chunks to be given to different threads","                Object[] sliceToProcess = new Object[numberOfRecordsToProcess];","                Array.Copy(arrayToProcess, i * numberOfRecordsPerThread, sliceToProcess, 0, numberOfRecordsToProcess);","                ProcessorThread processorThread = new ProcessorThread(i, recordProcessor, resultsHandler, sliceToProcess);","                threads[i] = new Thread(processorThread.processThreadRecords);","                threads[i].Start();","            }","            foreach (Thread t in threads)","            {","                t.Join();","            }","","            return resultsHandler.finalise();","        }","","        static IRecordProcessor recordProcessorFactory(string name)","        {","            switch (name)","            {","                case \"DomainControllers\":","                    return new DomainControllerRecordProcessor();","                case \"SchemaHistory\":","                    return new SchemaRecordProcessor();","                case \"Users\":","                    return new UserRecordProcessor();","                case \"UserSPNs\":","                    return new UserSPNRecordProcessor();","                case \"Groups\":","                    return new GroupRecordProcessor();","                case \"GroupChanges\":","                    return new GroupChangeRecordProcessor();","                case \"GroupsDictionary\":","                    return new GroupRecordDictionaryProcessor();","                case \"GroupMembers\":","                    return new GroupMemberRecordProcessor();","                case \"OUs\":","                    return new OURecordProcessor();","                case \"GPOs\":","                    return new GPORecordProcessor();","                case \"GPOsDictionary\":","                    return new GPORecordDictionaryProcessor();","                case \"SOMs\":","                    return new SOMRecordProcessor();","                case \"Printers\":","                    return new PrinterRecordProcessor();","                case \"Computers\":","                    return new ComputerRecordProcessor();","                case \"ComputerSPNs\":","                    return new ComputerSPNRecordProcessor();","                case \"LAPS\":","                    return new LAPSRecordProcessor();","                case \"SIDDictionary\":","                    return new SIDRecordDictionaryProcessor();","                case \"DACLs\":","                    return new DACLRecordProcessor();","                case \"SACLs\":","                    return new SACLRecordProcessor();","            }","            throw new ArgumentException(\"Invalid processor type \" + name);","        }","","        class ProcessorThread","        {","            readonly int id;","            readonly IRecordProcessor recordProcessor;","            readonly IResultsHandler resultsHandler;","            readonly Object[] objectsToBeProcessed;","","            public ProcessorThread(int id, IRecordProcessor recordProcessor, IResultsHandler resultsHandler, Object[] objectsToBeProcessed)","            {","                this.recordProcessor = recordProcessor;","                this.id = id;","                this.resultsHandler = resultsHandler;","                this.objectsToBeProcessed = objectsToBeProcessed;","            }","","            public void processThreadRecords()","            {","                for (int i = 0; i \u003c objectsToBeProcessed.Length; i++)","                {","                    Object[] result = recordProcessor.processRecord(objectsToBeProcessed[i]);","                    resultsHandler.processResults(result); //this is a thread safe operation","                }","            }","        }","","        //The interface and implmentation class used to process a record (this implemmentation just returns a log type string)","","        interface IRecordProcessor","        {","            PSObject[] processRecord(Object record);","        }","","        class DomainControllerRecordProcessor : IRecordProcessor","        {","            public PSObject[] processRecord(Object record)","            {","                try","                {","                    PSObject AdDC = (PSObject) record;","                    bool Infra = false;","                    bool Naming = false;","                    bool Schema = false;","                    bool RID = false;","                    bool PDC = false;","                    PSObject DCSMBObj = new PSObject();","","                    string OperatingSystem = CleanString((AdDC.Members[\"OperatingSystem\"].Value != null ? AdDC.Members[\"OperatingSystem\"].Value : \"-\") + \" \" + AdDC.Members[\"OperatingSystemHotfix\"].Value + \" \" + AdDC.Members[\"OperatingSystemServicePack\"].Value + \" \" + AdDC.Members[\"OperatingSystemVersion\"].Value);","","                    foreach (var OperationMasterRole in (Microsoft.ActiveDirectory.Management.ADPropertyValueCollection) AdDC.Members[\"OperationMasterRoles\"].Value)","                    {","                        switch (OperationMasterRole.ToString())","                        {","                            case \"InfrastructureMaster\":","                            Infra = true;","                            break;","                            case \"DomainNamingMaster\":","                            Naming = true;","                            break;","                            case \"SchemaMaster\":","                            Schema = true;","                            break;","                            case \"RIDMaster\":","                            RID = true;","                            break;","                            case \"PDCEmulator\":","                            PDC = true;","                            break;","                        }","                    }","                    PSObject DCObj = new PSObject();","                    DCObj.Members.Add(new PSNoteProperty(\"Domain\", AdDC.Members[\"Domain\"].Value));","                    DCObj.Members.Add(new PSNoteProperty(\"Site\", AdDC.Members[\"Site\"].Value));","                    DCObj.Members.Add(new PSNoteProperty(\"Name\", AdDC.Members[\"Name\"].Value));","                    DCObj.Members.Add(new PSNoteProperty(\"IPv4Address\", AdDC.Members[\"IPv4Address\"].Value));","                    DCObj.Members.Add(new PSNoteProperty(\"Operating System\", OperatingSystem));","                    DCObj.Members.Add(new PSNoteProperty(\"Hostname\", AdDC.Members[\"HostName\"].Value));","                    DCObj.Members.Add(new PSNoteProperty(\"Infra\", Infra));","                    DCObj.Members.Add(new PSNoteProperty(\"Naming\", Naming));","                    DCObj.Members.Add(new PSNoteProperty(\"Schema\", Schema));","                    DCObj.Members.Add(new PSNoteProperty(\"RID\", RID));","                    DCObj.Members.Add(new PSNoteProperty(\"PDC\", PDC));","                    if (AdDC.Members[\"IPv4Address\"].Value != null)","                    {","                        DCSMBObj = GetPSObject(AdDC.Members[\"IPv4Address\"].Value);","                    }","                    else","                    {","                        DCSMBObj = new PSObject();","                        DCSMBObj.Members.Add(new PSNoteProperty(\"SMB Port Open\", false));","                    }","                    foreach (PSPropertyInfo psPropertyInfo in DCSMBObj.Properties)","                    {","                        if (Convert.ToString(psPropertyInfo.Name) == \"SMB Port Open\" \u0026\u0026 (bool) psPropertyInfo.Value == false)","                        {","                            DCObj.Members.Add(new PSNoteProperty(psPropertyInfo.Name, psPropertyInfo.Value));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB1(NT LM 0.12)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB2(0x0202)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB2(0x0210)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB3(0x0300)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB3(0x0302)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB3(0x0311)\", null));","                            DCObj.Members.Add(new PSNoteProperty(\"SMB Signing\", null));","                            break;","                        }","                        else","                        {","                            DCObj.Members.Add(new PSNoteProperty(psPropertyInfo.Name, psPropertyInfo.Value));","                        }","                    }","                    return new PSObject[] { DCObj };","                }","                catch (Exception e)","                {","                    Console.WriteLine(\"{0} Exception caught.\", e);","                    return new PSObject[] { };","                }","            }","        }","","        class SchemaRecordProcessor : IRecordProcessor","        {","            public PSObject[] processRecord(Object record)","            {","                try","                {","                    PSObject AdSchema = (PSObject) record;","","                    PSObject SchemaObj = new PSObject();","                    SchemaObj.Members.Add(new PSNoteProperty(\"ObjectClass\", AdSchema.Members[\"ObjectClass\"].Value));","                    SchemaObj.Members.Add(new PSNoteProperty(\"Name\", AdSchema.Members[\"Name\"].Value));","                    SchemaObj.Members.Add(new PSNoteProperty(\"whenCreated\", AdSchema.Members[\"whenCreated\"].Value));","                    SchemaObj.Members.Add(new PSNoteProperty(\"whenChanged\", AdSchema.Members[\"whenChanged\"].Value));","                    SchemaObj.Members.Add(new PSNoteProperty(\"DistinguishedName\", AdSchema.Members[\"DistinguishedName\"].Value));","                    return new PSObject[] { SchemaObj };","                }","                catch (Exception e)","                {","                    Console.WriteLine(\"Exception caught: {0}\", e);","                    return new PSObject[] { };","                }","            }","        }","","        class UserRecordProcessor : IRecordProcessor","        {","            public PSObject[] processRecord(Object record)","            {","                try","                {","                    PSObject AdUser = (PSObject) record;","                    bool? Enabled = null;","                    bool MustChangePasswordatLogon = false;","                    bool PasswordNotChangedafterMaxAge = false;","                    bool NeverLoggedIn = false;","                    int? DaysSinceLastLogon = null;","                    int? DaysSinceLastPasswordChange = null;","                    int? AccountExpirationNumofDays = null;","                    bool Dormant = false;","                    string SIDHistory = \"\";","                    bool? KerberosRC4 = null;","                    bool? KerberosAES128 = null;","                    bool? KerberosAES256 = null;","                    string DelegationType = null;","                    string DelegationProtocol = null;","                    string DelegationServices = null;","                    DateTime? LastLogonDate = null;","                    DateTime? PasswordLastSet = null;","                    DateTime? AccountExpires = null;","                    bool? AccountNotDelegated = null;","                    bool? HasSPN = null;","","                    try","                    {","                        // The Enabled field can be blank which raises an exception. This may occur when the user is not allowed to query the UserAccountControl attribute.","                        Enabled = (bool) AdUser.Members[\"Enabled\"].Value;","                    }","                    catch //(Exception e)","                    {","                        //Console.WriteLine(\"Exception caught: {0}\", e);","                    }","                    if (AdUser.Members[\"lastLogonTimeStamp\"].Value != null)","                    {","                        //LastLogonDate = DateTime.FromFileTime((long)(AdUser.Members[\"lastLogonTimeStamp\"].Value));","                        // LastLogonDate is lastLogonTimeStamp converted to local time","                        LastLogonDate = Convert.ToDateTime(AdUser.Members[\"LastLogonDate\"].Value);","                        DaysSinceLastLogon = Math.Abs((Date1 - (DateTime)LastLogonDate).Days);","                        if (DaysSinceLastLogon \u003e DormantTimeSpan)","                        {","                            Dormant = true;","                        }","                    }","                    else","                    {","                        NeverLoggedIn = true;","                    }","                    if (Convert.ToString(AdUser.Members[\"pwdLastSet\"].Value) == \"0\")","                    {","                        if ((bool) AdUser.Members[\"PasswordNeverExpires\"].Value == false)","                        {","                            MustChangePasswordatLogon = true;","                        }","                    }","                    if (AdUser.Members[\"PasswordLastSet\"].Value != null)","                    {","                        //PasswordLastSet = DateTime.FromFileTime((long)(AdUser.Members[\"pwdLastSet\"].Value));","                        // PasswordLastSet is pwdLastSet converted to local time","                        PasswordLastSet = Convert.ToDateTime(AdUser.Members[\"PasswordLastSet\"].Value);","                        DaysSinceLastPasswordChange = Math.Abs((Date1 - (DateTime)PasswordLastSet).Days);","                        if (DaysSinceLastPasswordChange \u003e PassMaxAge)","                        {","                            PasswordNotChangedafterMaxAge = true;","                        }","                    }","                    //https://msdn.microsoft.com/en-us/library/ms675098(v=vs.85).aspx","                    //if ((Int64) AdUser.Members[\"accountExpires\"].Value != (Int64) 9223372036854775807)","                    //{","                        //if ((Int64) AdUser.Members[\"accountExpires\"].Value != (Int64) 0)","                        if (AdUser.Members[\"AccountExpirationDate\"].Value != null)","                        {","                            try","                            {","                                //AccountExpires = DateTime.FromFileTime((long)(AdUser.Members[\"accountExpires\"].Value));","                                // AccountExpirationDate is accountExpires converted to local time","                                AccountExpires = Convert.ToDateTime(AdUser.Members[\"AccountExpirationDate\"].Value);","                                AccountExpirationNumofDays = ((int)((DateTime)AccountExpires - Date1).Days);","","                            }"," 