                 ObjectObj.Members.Add(new PSNoteProperty(\"Inherited\", Rule.IsInherited));","                            ObjectObj.Members.Add(new PSNoteProperty(\"PropagationFlags\", Rule.PropagationFlags));","                            ObjectObj.Members.Add(new PSNoteProperty(\"ObjectType\", Rule.ObjectType));","                            ObjectObj.Members.Add(new PSNoteProperty(\"InheritedObjectType\", Rule.InheritedObjectType));","                            SACLList.Add( ObjectObj );","                        }","                    }","","                    return SACLList.ToArray();","                }","                catch (Exception e)","                {","                    Console.WriteLine(\"Exception caught: {0}\", e);","                    return new PSObject[] { };","                }","            }","        }","","        //The interface and implmentation class used to handle the results (this implementation just writes the strings to a file)","","        interface IResultsHandler","        {","            void processResults(Object[] t);","","            Object[] finalise();","        }","","        class SimpleResultsHandler : IResultsHandler","        {","            private Object lockObj = new Object();","            private List\u003cObject\u003e processed = new List\u003cObject\u003e();","","            public SimpleResultsHandler()","            {","            }","","            public void processResults(Object[] results)","            {","                lock (lockObj)","                {","                    if (results.Length != 0)","                    {","                        for (var i = 0; i \u003c results.Length; i++)","                        {","                            processed.Add((PSObject)results[i]);","                        }","                    }","                }","            }","","            public Object[] finalise()","            {","                return processed.ToArray();","            }"