ROUP        = 4,            // 0x00000004","            UNIVERSAL_GROUP    = 8,            // 0x00000008","            SECURITY_ENABLED   = -2147483648   // 0x80000000","        }","","\t\tprivate static readonly Dictionary\u003cstring, string\u003e Replacements = new Dictionary\u003cstring, string\u003e()","        {","            //{System.Environment.NewLine, \"\"},","            //{\",\", \";\"},","            {\"\\\"\", \"'\"}","        };","","        public static string CleanString(Object StringtoClean)","        {","            // Remove extra spaces and new lines","            string CleanedString = string.Join(\" \", ((Convert.ToString(StringtoClean)).Split((string[]) null, StringSplitOptions.RemoveEmptyEntries)));","            foreach (string Replacement in Replacements.Keys)","            {","                CleanedString = CleanedString.Replace(Replacement, Replacements[Replacement]);","            }","            return CleanedString;","        }","","        public static int ObjectCount(Object[] ADRObject)","        {","            return ADRObject.Length;","        }","","        public static Object[] DomainControllerParser(Object[] AdDomainControllers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdDomainControllers, numOfThreads, \"DomainControllers\");","            return ADRObj;","        }","","        public static Object[] SchemaParser(Object[] AdSchemas, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdSchemas, numOfThreads, \"SchemaHistory\");","            return ADRObj;","        }","","        public static Object[] UserParser(Object[] AdUsers, DateTime Date1, int DormantTimeSpan, int PassMaxAge, int numOfThreads)","        {","            LDAPClass.Date1 = Date1;","            LDAPClass.DormantTimeSpan = DormantTimeSpan;","            LDAPClass.PassMaxAge = PassMaxAge;","","            Object[] ADRObj = runProcessor(AdUsers, numOfThreads, \"Users\");","            return ADRObj;","        }","","        public static Object[] UserSPNParser(Object[] AdUsers, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdUsers, numOfThreads, \"UserSPNs\");","            return ADRObj;","        }","","        public static Object[] GroupParser(Object[] AdGroups, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdGroups, numOfThreads, \"Groups\");","            return ADRObj;","        }","","        public static Object[] GroupChangeParser(Object[] AdGroups, DateTime Date1, int numOfThreads)","        {","            LDAPClass.Date1 = Date1;","            Object[] ADRObj = runProcessor(AdGroups, numOfThreads, \"GroupChanges\");","            return ADRObj;","        }","","        public static Object[] GroupMemberParser(Object[] AdGroups, Object[] AdGroupMembers, string DomainSID, int numOfThreads)","        {","            LDAPClass.AdGroupDictionary = new Dictionary\u003cstring, string\u003e();","            runProcessor(AdGroups, numOfThreads, \"GroupsDictionary\");","            LDAPClass.DomainSID = DomainSID;","            Object[] ADRObj = runProcessor(AdGroupMembers, numOfThreads, \"GroupMembers\");","            return ADRObj;","        }","","        public static Object[] OUParser(Object[] AdOUs, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdOUs, numOfThreads, \"OUs\");","            return ADRObj;","        }","","        public static Object[] GPOParser(Object[] AdGPOs, int numOfThreads)","        {","            Object[] ADRObj = runProcessor(AdGPOs, numOfThreads, \"GPOs\");","            return ADRObj;","        }","","        public static Object[] SOMParser(Object[] AdGPOs, Object[] AdSOMs, int numOfThreads)","        {","            LDAPClass.AdGPODictionary = new Dictionary\u003cstring, string\u003e();","            runProcessor(AdGPOs, numOfThreads, \"GPOsDictionary\");","            Object[] ADRObj = runProcessor(AdSOMs, numOfThreads, \"SOMs\");",