rType)","        {","            int totalRecords = arrayToProcess.Length;","            IRecordProcessor recordProcessor = recordProcessorFactory(processorType);","            IResultsHandler resultsHandler = new SimpleResultsHandler ();","            int numberOfRecordsPerThread = totalRecords / numOfThreads;","            int remainders = totalRecords % numOfThreads;","","            Thread[] threads = new Thread[numOfThreads];","            for (int i = 0; i \u003c numOfThreads; i++)","            {","                int numberOfRecordsToProcess = numberOfRecordsPerThread;","                if (i == (numOfThreads - 1))","                {","                    //last thread, do the remaining records","                    numberOfRecordsToProcess += remainders;","                }","","                //split the full array into chunks to be given to different threads","                Object[] sliceToProcess = new Object[numberOfRecordsToProcess];","                Array.Copy(arrayToProcess, i * numberOfRecordsPerThread, sliceToProcess, 0, numberOfRecordsToProcess);","                ProcessorThread processorThread = new ProcessorThread(i, recordProcessor, resultsHandler, sliceToProcess);","                threads[i] = new Thread(processorThread.processThreadRecords);","                threads[i].Start();","            }","            foreach (Thread t in threads)","            {","                t.Join();","            }","","            return resultsHandler.finalise();","        }","","        static IRecordProcessor recordProcessorFactory(string name)","        {","            switch (name)","            {","                case \"DomainControllers\":","                    return new DomainControllerRecordProcessor();","                case \"SchemaHistory\":","                    return new SchemaRecordProcessor();","                case \"Users\":","                    return new UserRecordProcessor();","                case \"UserSPNs\":","              