mmand = command;","\t\t\theader.MessageId = 0;","\t\t\theader.Reserved = 0xFEFF;","\t\t\treturn getBytes(header);","\t\t}","\t\tstatic byte[] getBytes(object structure)","\t\t{","\t\t\tint size = Marshal.SizeOf(structure);","\t\t\tbyte[] arr = new byte[size];","\t\t\tIntPtr ptr = Marshal.AllocHGlobal(size);","\t\t\tMarshal.StructureToPtr(structure, ptr, true);","\t\t\tMarshal.Copy(ptr, arr, 0, size);","\t\t\tMarshal.FreeHGlobal(ptr);","\t\t\treturn arr;","\t\t}","\t\tstatic byte[] getDialect(string dialect)","\t\t{","\t\t\tbyte[] dialectBytes = Encoding.ASCII.GetBytes(dialect);","\t\t\tbyte[] output = new byte[dialectBytes.Length + 2];","\t\t\toutput[0] = 2;","\t\t\toutput[output.Length - 1] = 0;","\t\t\tArray.Copy(dialectBytes, 0, output, 1, dialectBytes.Length);","\t\t\treturn output;","\t\t}","\t\tstatic byte[] GetNegotiateMessage(byte[] dialect)","\t\t{","\t\t\tbyte[] output = new byte[dialect.Length + 3];","\t\t\toutput[0] = 0;","\t\t\toutput[1] = (byte) dialect.Length;","\t\t\toutput[2] = 0;","\t\t\tArray.Copy(dialect, 0, output, 3, dialect.Length);","\t\t\treturn output;","\t\t}","\t\t// MS-SMB2  2.2.3 SMB2 NEGOTIATE Request","\t\tstatic byte[] GetNegotiateMessageSmbv2(int DialectToTest)","\t\t{","\t\t\tSMB2_NegotiateRequest request = new SMB2_NegotiateRequest();","\t\t\trequest.StructureSize = 36;","\t\t\trequest.DialectCount = 1;","\t\t\trequest.SecurityMode = 1; // signing enabled","\t\t\trequest.ClientGuid = Guid.NewGuid();","\t\t\trequest.DialectToTest = (UInt16) DialectToTest;","\t\t\treturn getBytes(request);","\t\t}","\t\tstatic byte[] GetNegotiatePacket(byte[] header, byte[] smbPacket)","\t\t{","\t\t\tbyte[] output = new byte[smbPacket.Length + header.Length + 4];","\t\t\toutput[0] = 0;","\t\t\toutput[1] = 0;","\t\t\toutput[2] = 0;","\t\t\toutput[3] = (byte)(smbPacket.Length + header.Length);","\t\t\tArray.Copy(header, 0, output, 4, header.Length);","\t\t\tArray.Copy(smbPacket, 0, output, 4 + header.Length, smbPacket.Length);","\t\t\treturn output;","\t\t}","\t\tpublic static bool DoesServerSupportDialect(string server, string dialect)","\t\t{","\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV1 dialect \" + dialect);","\t\t\tTcpClient client = new TcpClient();","\t\t\ttry","\t\t\t{","\t\t\t\tclient.Connect(server, 445);","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\tthrow new Exception(\"port 445 is closed on \" + server);","\t\t\t}","\t\t\ttry","\t\t\t{","\t\t\t\tNetworkStream stream = client.GetStream();","\t\t\t\tbyte[] header = GenerateSmbHeaderFromCommand(SMB_COM_NEGOTIATE);","\t\t\t\tbyte[] dialectEncoding = getDialect(dialect);","\t\t\t\tbyte[] negotiatemessage = GetNegotiateMessage(dialectEncoding);","\t\t\t\tbyte[] packet = GetNegotiatePacket(header, negotiatemessage);","\t\t\t\tstream.Write(packet, 0, packet.Length);","\t\t\t\tstream.Flush();","\t\t\t\tbyte[] netbios = new byte[4];","\t\t\t\tif (stream.Read(netbios, 0, netbios.Length) != netbios.Length)","                {","                    return false;","                }","\t\t\t\tbyte[] smbHeader = new byte[Marshal.SizeOf(typeof(SMB_Header))];","\t\t\t\tif (stream.Read(smbHeader, 0, smbHeader.Length) != smbHeader.Length)","                {","                    return false;","                }","\t\t\t\tbyte[] negotiateresponse = new byte[3];","\t\t\t\tif (stream.Read(negotiateresponse, 0, negotiateresponse.Length) != negotiateresponse.Length)","                {","                    return false;","                }","\t\t\t\tif (negotiateresponse[1] == 0 \u0026\u0026 negotiateresponse[2] == 0)","\t\t\t\t{","\t\t\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV1 dialect \" + dialect + \" = Supported\");","\t\t\t\t\treturn true;","\t\t\t\t}","\t\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV1 dialect \" + dialect + \" = Not supported\");","\t\t\t\treturn false;","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\tthrow new ApplicationException(\"Smb1 is not supported on \" + server);","\t\t\t}","\t\t}","\t\tpublic static bool DoesServerSupportDialectWithSmbV2(string server, int dialect, bool checkSMBSigning)","\t\t{","\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV2 dialect 0x\" + dialect.ToString(\"X2\"));","\t\t\tTcpClient client = new TcpClient();","\t\t\ttry","\t\t\t{","\t\t\t\tclient.Connect(server, 445);","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\tthrow new Exception(\"port 445 is closed on \" + server);","\t\t\t}","\t\t\ttry","\t\t\t{","\t\t\t\tNetworkStream stream = client.GetStream();","\t\t\t\tbyte[] header = GenerateSmb2HeaderFromCommand(SMB2_NEGOTIATE);","\t\t\t\tbyte[] negotiatemessage = GetNegotiateMessageSmbv2(dialect);","\t\t\t\tbyte[] packet = GetNegotiatePacket(header, negotiatemessage);","\t\t\t\tstream.Write(packet, 0, packet.Length);","\t\t\t\tstream.Flush();","\t\t\t\tbyte[] netbios = new byte[4];","\t\t\t\tif( stream.Read(netbios, 0, netbios.Length) != netbios.Length)","                {","                    return false;","                }","\t\t\t\tbyte[] smbHeader = new byte[Marshal.SizeOf(typeof(SMB2_Header))];","\t\t\t\tif (stream.Read(smbHeader, 0, smbHeader.Length) != smbHeader.Length)","                {","                    return false;","                }","\t\t\t\tif (smbHeader[8] != 0 || smbHeader[9] != 0 || smbHeader[10] != 0 || smbHeader[11] != 0)","\t\t\t\t{","\t\t\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV2 dialect 0x\" + dialect.ToString(\"X2\") + \" = Not supported via error code\");","\t\t\t\t\treturn false;","\t\t\t\t}","\t\t\t\tbyte[] negotiateresponse = new byte[6];","\t\t\t\tif (stream.Read(negotiateresponse, 0, negotiateresponse.Length) != negotiateresponse.Length)","                {","                    return false;","                }","                if (checkSMBSigning)","                {","                    // https://support.microsoft.com/en-in/help/887429/overview-of-server-message-block-signing","                    // https://msdn.microsoft.com/en-us/library/cc246561.aspx","\t\t\t\t    if (negotiateresponse[2] == 3)","\t\t\t\t    {","\t\t\t\t\t    Trace.WriteLine(\"Checking \" + server + \" for SMBV2 SMB Signing dialect 0x\" + dialect.ToString(\"X2\") + \" = Supported\");","\t\t\t\t\t    return true;","\t\t\t\t    }","                    else","                    {","                        return false;","                    }","                }","\t\t\t\tint selectedDialect = negotiateresponse[5] * 0x100 + negotiateresponse[4];","\t\t\t\tif (selectedDialect == dialect)","\t\t\t\t{","\t\t\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV2 dialect 0x\" + dialect.ToString(\"X2\") + \" = Supported\");","\t\t\t\t\treturn true;","\t\t\t\t}","\t\t\t\tTrace.WriteLine(\"Checking \" + server + \" for SMBV2 dialect 0x\" + dialect.ToString(\"X2\") + \" = Not supported via not returned dialect\");","\t\t\t\treturn false;","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\tthrow new ApplicationException(\"Smb2 is not supported on \" + server);","\t\t\t}","\t\t}","\t\tpublic static bool SupportSMB1(string server)","\t\t{","\t\t\ttry","\t\t\t{","\t\t\t\treturn DoesServerSupportDialect(server, \"NT LM 0.12\");","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\treturn false;","\t\t\t}","\t\t}","\t\tpublic static bool SupportSMB2(string server)","\t\t{","\t\t\ttry","\t\t\t{","\t\t\t\treturn (DoesServerSupportDialectWithSmbV2(server, 0x0202, false) || DoesServerSupportDialectWithSmbV2(server, 0x0210, false));","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\treturn false;","\t\t\t}","\t\t}","\t\tpublic static bool SupportSMB3(string server)","\t\t{","\t\t\ttry","\t\t\t{","\t\t\t\treturn (DoesServerSupportDialectWithSmbV2(server, 0x0300, false) || DoesServerSupportDialectWithSmbV2(server, 0x0302, false) || DoesServerSupportDialectWithSmbV2(server, 0x0311, false));","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\treturn false;","\t\t\t}","\t\t}","\t\tpublic static string Name { get { return \"smb\"; } }","\t\tpublic static PSObject GetPSObject(Object IPv4Address)","\t\t{","            string computer = Convert.ToString(IPv4Address);","            PSObject DCSMBObj = new PSObject();","            if (computer == \"\")","            {","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB Port Open\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB1(NT LM 0.12)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB2(0x0202)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB2(0x0210)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0300)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0302)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0311)\", null));","                DCSMBObj.Members.Add(new PSNoteProperty(\"SMB Signing\", null));","                return DCSMBObj;","            }","            bool isPortOpened = true;","\t\t\tbool SMBv1 = false;","\t\t\tbool SMBv2_0x0202 = false;","\t\t\tbool SMBv2_0x0210 = false;","\t\t\tbool SMBv3_0x0300 = false;","\t\t\tbool SMBv3_0x0302 = false;","\t\t\tbool SMBv3_0x0311 = false;","            bool SMBSigning = false;","\t\t\ttry","\t\t\t{","\t\t\t\ttry","\t\t\t\t{","\t\t\t\t\tSMBv1 = DoesServerSupportDialect(computer, \"NT LM 0.12\");","\t\t\t\t}","\t\t\t\tcatch (ApplicationException)","\t\t\t\t{","\t\t\t\t}","\t\t\t\ttry","\t\t\t\t{","\t\t\t\t\tSMBv2_0x0202 = DoesServerSupportDialectWithSmbV2(computer, 0x0202, false);","\t\t\t\t\tSMBv2_0x0210 = DoesServerSupportDialectWithSmbV2(computer, 0x0210, false);","\t\t\t\t\tSMBv3_0x0300 = DoesServerSupportDialectWithSmbV2(computer, 0x0300, false);","\t\t\t\t\tSMBv3_0x0302 = DoesServerSupportDialectWithSmbV2(computer, 0x0302, false);","\t\t\t\t\tSMBv3_0x0311 = DoesServerSupportDialectWithSmbV2(computer, 0x0311, false);","\t\t\t\t}","\t\t\t\tcatch (ApplicationException)","\t\t\t\t{","\t\t\t\t}","\t\t\t}","\t\t\tcatch (Exception)","\t\t\t{","\t\t\t\tisPortOpened = false;","\t\t\t}","\t\t\tif (SMBv3_0x0311)","\t\t\t{","\t\t\t\tSMBSigning = DoesServerSupportDialectWithSmbV2(computer, 0x0311, true);","\t\t\t}","\t\t\telse if (SMBv3_0x0302)","\t\t\t{","\t\t\t\tSMBSigning = DoesServerSupportDialectWithSmbV2(computer, 0x0302, true);","\t\t\t}","\t\t\telse if (SMBv3_0x0300)","\t\t\t{","\t\t\t\tSMBSigning = DoesServerSupportDialectWithSmbV2(computer, 0x0300, true);","\t\t\t}","\t\t\telse if (SMBv2_0x0210)","\t\t\t{","\t\t\t\tSMBSigning = DoesServerSupportDialectWithSmbV2(computer, 0x0210, true);","\t\t\t}","\t\t\telse if (SMBv2_0x0202)","\t\t\t{","\t\t\t\tSMBSigning = DoesServerSupportDialectWithSmbV2(computer, 0x0202, true);","\t\t\t}","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB Port Open\", isPortOpened));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB1(NT LM 0.12)\", SMBv1));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB2(0x0202)\", SMBv2_0x0202));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB2(0x0210)\", SMBv2_0x0210));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0300)\", SMBv3_0x0300));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0302)\", SMBv3_0x0302));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB3(0x0311)\", SMBv3_0x0311));","            DCSMBObj.Members.Add(new PSNoteProperty(\"SMB Signing\", SMBSigning));","            return DCSMBObj;","\t\t}","\t}","}","\"@","","# Import the LogonUser, ImpersonateLoggedOnUser and RevertToSelf Functions from advapi32.dll and the CloseHandle Function from kernel32.dll","# https://docs.microsoft.com/en-gb/powershell/module/Microsoft.PowerShell.Utility/Add-Type?view=powershell-5.1","# https://msdn.microsoft.com/en-us/library/windows/desktop/aa378184(v=vs.85).aspx","# https://msdn.microsoft.com/en-us/library/windows/desktop/aa378612(v=vs.85).aspx","# https://msdn.microsoft.com/en-us/library/windows/desktop/aa379317(v=vs.85).aspx","","$Advapi32Def = @'","    [DllImport(\"advapi32.dll\", SetLastError = true)]","    public static extern bool LogonUser(string lpszUsername, string lpszDomain, string lpszPassword, int dwLogonType, int dwLogonProvider, out IntPtr phToken);","","    [DllImport(\"advapi32.dll\", SetLastError = true)]","    public static extern bool ImpersonateLoggedOnUser(IntPtr hToken);","","    [DllImport(\"advapi32.dll\", SetLastError = true)]","    public static extern bool RevertToSelf();","'@","","# https://msdn.microsoft.com/en-us/library/windows/desktop/ms724211(v=vs.85).aspx","","$Kernel32Def = @'","    [DllImport(\"kernel32.dll\", SetLastError = true)]","    public static extern bool CloseHandle(IntPtr hObject);","'@","","Function Get-DateDiff","{","\u003c#",".SYNOPSIS","    Get difference between two dates.","",".DESCRIPTION","    Returns the difference between two dates.","",".PARAMETER Date1","    [DateTime]","    Date","",".PARAMETER Date2","    [DateTime]","    Date","",".OUTPUTS","    [System.ValueType.TimeSpan]","    Returns the difference between the two dates.","#\u003e","    param (","        [Parameter(Mandatory = $true)]","        [DateTime] $Date1,","","        [Parameter(Mandatory = $true)]","        [DateTime] $Date2","    )","","    If ($Date2 -gt $Date1)","    {","        $DDiff = $Date2 - $Date1","    }","    Else","    {","        $DDiff = $Date1 - $Date2","    }","    Return $DDiff","}","","Function Get-DNtoFQDN","{","\u003c#",".SYNOPSIS","    Gets Domain Distinguished Name (DN) from the Fully Qualified Domain Name (FQDN).","",".DESCRIPTION","    Converts Domain Distinguished Name (DN) to Fully Qualified Domain Name (FQDN).","",".PARAMETER ADObjectDN","    [string]","    Domain Distinguished Name (DN)","",".OUTPUTS","    [String]","    Returns the Fully Qualified Domain Name (FQDN).","",".LINK","    https://adsecurity.org/?p=440","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $ADObjectDN","    )","","    $Index = $ADObjectDN.IndexOf('DC=')","    If ($Index)","    {","        $ADObjectDNDomainName = $($ADObjectDN.SubString($Index)) -replace 'DC=','' -replace ',','.'","    }","    Else","    {","        # Modified version from https://adsecurity.org/?p=440","        [array] $ADObjectDNArray = $ADObjectDN -Split (\"DC=\")","        $ADObjectDNArray | ForEach-Object {","            [array] $temp = $_ -Split (\",\")","            [string] $ADObjectDNArrayItemDomainName += $temp[0] + \".\"","        }","        $ADObjectDNDomainName = $ADObjectDNArrayItemDomainName.Substring(1, $ADObjectDNArrayItemDomainName.Length - 2)","    }","    Return $ADObjectDNDomainName","}","","Function Export-ADRCSV","{","\u003c#",".SYNOPSIS","    Exports Object to a CSV file.","",".DESCRIPTION","    Exports Object to a CSV file using Export-CSV.","",".PARAMETER ADRObj","    [PSObject]","    ADRObj","",".PARAMETER ADFileName","    [String]","    Path to save the CSV File.","",".OUTPUTS","    CSV file.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [PSObject] $ADRObj,","","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [String] $ADFileName","    )","","    Try","    {","        $ADRObj | Export-Csv -Path $ADFileName -NoTypeInformation -Encoding Default","    }","    Catch","    {","        Write-Warning \"[Export-ADRCSV] Failed to export $($ADFileName).\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","    }","}","","Function Export-ADRXML","{","\u003c#",".SYNOPSIS","    Exports Object to a XML file.","",".DESCRIPTION","    Exports Object to a XML file using Export-Clixml.","",".PARAMETER ADRObj","    [PSObject]","    ADRObj","",".PARAMETER ADFileName","    [String]","    Path to save the XML File.","",".OUTPUTS","    XML file.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [PSObject] $ADRObj,","","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [String] $ADFileName","    )","","    Try","    {","        (ConvertTo-Xml -NoTypeInformation -InputObject $ADRObj).Save($ADFileName)","    }","    Catch","    {","        Write-Warning \"[Export-ADRXML] Failed to export $($ADFileName).\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","    }","}","","Function Export-ADRJSON","{","\u003c#",".SYNOPSIS","    Exports Object to a JSON file.","",".DESCRIPTION","    Exports Object to a JSON file using ConvertTo-Json.","",".PARAMETER ADRObj","    [PSObject]","    ADRObj","",".PARAMETER ADFileName","    [String]","    Path to save the JSON File.","",".OUTPUTS","    JSON file.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [PSObject] $ADRObj,","","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [String] $ADFileName","    )","","    Try","    {","        ConvertTo-JSON -InputObject $ADRObj | Out-File -FilePath $ADFileName","    }","    Catch","    {","        Write-Warning \"[Export-ADRJSON] Failed to export $($ADFileName).\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","    }","}","","Function Export-ADRHTML","{","\u003c#",".SYNOPSIS","    Exports Object to a HTML file.","",".DESCRIPTION","    Exports Object to a HTML file using ConvertTo-Html.","",".PARAMETER ADRObj","    [PSObject]","    ADRObj","",".PARAMETER ADFileName","    [String]","    Path to save the HTML File.","",".OUTPUTS","    HTML file.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [PSObject] $ADRObj,","","        [Parameter(Mandatory = $true)]","        [ValidateNotNullOrEmpty()]","        [String] $ADFileName,","","        [Parameter(Mandatory = $false)]","        [String] $ADROutputDir = $null","    )","","$Header = @\"","\u003cstyle type=\"text/css\"\u003e","th {","\tcolor:white;","\tbackground-color:blue;","}","td, th {","\tborder:0px solid black;","\tborder-collapse:collapse;","\twhite-space:pre;","}","tr:nth-child(2n+1) {","    background-color: #dddddd;","}","tr:hover td {","    background-color: #c1d5f8;","}","table, tr, td, th {","\tpadding: 0px;","\tmargin: 0px;","\twhite-space:pre;","}","table {","\tmargin-left:1px;","}","\u003c/style\u003e","\"@","    Try","    {","        If ($ADFileName.Contains(\"Index\"))","        {","            $HTMLPath  = -join($ADROutputDir,'\\','HTML-Files')","            $HTMLPath = $((Convert-Path $HTMLPath).TrimEnd(\"\\\"))","            $HTMLFiles = Get-ChildItem -Path $HTMLPath -name","            $HTML = $HTMLFiles | ConvertTo-HTML -Title \"ADRecon\" -Property @{Label=\"Table of Contents\";Expression={\"\u003ca href='$($_)'\u003e$($_)\u003c/a\u003e\"}} -Head $Header","","            Add-Type -AssemblyName System.Web","            [System.Web.HttpUtility]::HtmlDecode($HTML) | Out-File -FilePath $ADFileName","        }","        Else","        {","            If ($ADRObj -is [array])","            {","                $ADRObj | Select-Object * | ConvertTo-HTML -As Table -Head $Header | Out-File -FilePath $ADFileName","            }","            Else","            {","                ConvertTo-HTML -InputObject $ADRObj -As Table -Head $Header | Out-File -FilePath $ADFileName","            }","        }","    }","    Catch","    {","        Write-Warning \"[Export-ADRHTML] Failed to export $($ADFileName).\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","    }","}","","Function Export-ADR","{","\u003c#",".SYNOPSIS","    Helper function for all output types supported.","",".DESCRIPTION","    Helper function for all output types supported.","",".PARAMETER ADObjectDN","    [PSObject]","    ADRObj","",".PARAMETER ADROutputDir","    [String]","    Path for ADRecon output folder.","",".PARAMETER OutputType","    [array]","    Output Type.","",".PARAMETER ADRModuleName","    [String]","    Module Name.","",".OUTPUTS","    STDOUT, CSV, XML, JSON and/or HTML file, etc.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [PSObject] $ADRObj,","","        [Parameter(Mandatory = $true)]","        [String] $ADROutputDir,","","        [Parameter(Mandatory = $true)]","        [array] $OutputType,","","        [Parameter(Mandatory = $true)]","        [String] $ADRModuleName","    )","","    Switch ($OutputType)","    {","        'STDOUT'","        {","            If ($ADRModuleName -ne \"AboutADRecon\")","            {","                If ($ADRObj -is [array])","                {","                    # Fix for InvalidOperationException: The object of type \"Microsoft.PowerShell.Commands.Internal.Format.FormatStartData\" is not valid or not in the correct sequence.","                    $ADRObj | Out-String -Stream","                }","                Else","                {","                    # Fix for InvalidOperationException: The object of type \"Microsoft.PowerShell.Commands.Internal.Format.FormatStartData\" is not valid or not in the correct sequence.","                    $ADRObj | Format-List | Out-String -Stream","                }","            }","        }","        'CSV'","        {","            $ADFileName  = -join($ADROutputDir,'\\','CSV-Files','\\',$ADRModuleName,'.csv')","            Export-ADRCSV -ADRObj $ADRObj -ADFileName $ADFileName","        }","        'XML'","        {","            $ADFileName  = -join($ADROutputDir,'\\','XML-Files','\\',$ADRModuleName,'.xml')","            Export-ADRXML -ADRObj $ADRObj -ADFileName $ADFileName","        }","        'JSON'","        {","            $ADFileName  = -join($ADROutputDir,'\\','JSON-Files','\\',$ADRModuleName,'.json')","            Export-ADRJSON -ADRObj $ADRObj -ADFileName $ADFileName","        }","        'HTML'","        {","            $ADFileName  = -join($ADROutputDir,'\\','HTML-Files','\\',$ADRModuleName,'.html')","            Export-ADRHTML -ADRObj $ADRObj -ADFileName $ADFileName -ADROutputDir $ADROutputDir","        }","    }","}","","Function Get-ADRExcelComObj","{","\u003c#",".SYNOPSIS","    Creates a ComObject to interact with Microsoft Excel.","",".DESCRIPTION","    Creates a ComObject to interact with Microsoft Excel if installed, else warning is raised.","",".OUTPUTS","    [System.__ComObject] and [System.MarshalByRefObject]","    Creates global variables $excel and $workbook.","#\u003e","","    #Check if Excel is installed.","    Try","    {","        # Suppress verbose output","        $SaveVerbosePreference = $script:VerbosePreference","        $script:VerbosePreference = 'SilentlyContinue'","        $global:excel = New-Object -ComObject excel.application","        If ($SaveVerbosePreference)","        {","            $script:VerbosePreference = $SaveVerbosePreference","            Remove-Variable SaveVerbosePreference","        }","    }","    Catch","    {","        If ($SaveVerbosePreference)","        {","            $script:VerbosePreference = $SaveVerbosePreference","            Remove-Variable SaveVerbosePreference","        }","        Write-Warning \"[Get-ADRExcelComObj] Excel does not appear to be installed. Skipping generation of ADRecon-Report.xlsx. Use the -GenExcel parameter to generate the ADRecon-Report.xslx on a host with Microsoft Excel installed.\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        Return $null","    }","    $excel.Visible = $true","    $excel.Interactive = $false","    $global:workbook = $excel.Workbooks.Add()","    If ($workbook.Worksheets.Count -eq 3)","    {","        $workbook.WorkSheets.Item(3).Delete()","        $workbook.WorkSheets.Item(2).Delete()","    }","}","","Function Get-ADRExcelComObjRelease","{","\u003c#",".SYNOPSIS","    Releases the ComObject created to interact with Microsoft Excel.","",".DESCRIPTION","    Releases the ComObject created to interact with Microsoft Excel.","",".PARAMETER ComObjtoRelease","    ComObjtoRelease","",".PARAMETER Final","    Final","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        $ComObjtoRelease,","","        [Parameter(Mandatory = $false)]","        [bool] $Final = $false","    )","    # https://msdn.microsoft.com/en-us/library/system.runtime.interopservices.marshal.releasecomobject(v=vs.110).aspx","    # https://msdn.microsoft.com/en-us/library/system.runtime.interopservices.marshal.finalreleasecomobject(v=vs.110).aspx","    If ($Final)","    {","        [System.Runtime.InteropServices.Marshal]::FinalReleaseComObject($ComObjtoRelease) | Out-Null","    }","    Else","    {","        [System.Runtime.InteropServices.Marshal]::ReleaseComObject($ComObjtoRelease) | Out-Null","    }","    [System.GC]::Collect()","    [System.GC]::WaitForPendingFinalizers()","}","","Function Get-ADRExcelWorkbook","{","\u003c#",".SYNOPSIS","    Adds a WorkSheet to the Workbook.","",".DESCRIPTION","    Adds a WorkSheet to the Workbook using the $workboook global variable and assigns it a name.","",".PARAMETER name","    [string]","    Name of the WorkSheet.","#\u003e","    param (","        [Parameter(Mandatory = $true)]","        [string] $name","    )","","    $workbook.Worksheets.Add() | Out-Null","    $worksheet = $workbook.Worksheets.Item(1)","    $worksheet.Name = $name","","    Get-ADRExcelComObjRelease -ComObjtoRelease $worksheet","    Remove-Variable worksheet","}","","Function Get-ADRExcelImport","{","\u003c#",".SYNOPSIS","    Helper to import CSV to the current WorkSheet.","",".DESCRIPTION","    Helper to import CSV to the current WorkSheet. Supports two methods.","",".PARAMETER ADFileName","    [string]","    Filename of the CSV file to import.","",".PARAMETER method","    [int]","    Method to use for the import.","    3 - Prints data horizontally. Headers column 1, then first data row in column 2, etc.","",".PARAMETER row","    [int]","    Row.","",".PARAMETER column","    [int]","    Column.","#\u003e","    param (","        [Parameter(Mandatory = $true)]","        [string] $ADFileName,","","        [Parameter(Mandatory = $false)]","        [int] $Method = 1,","","        [Parameter(Mandatory = $false)]","        [int] $row = 1,","","        [Parameter(Mandatory = $false)]","        [int] $column = 1","    )","","    $excel.ScreenUpdating = $false","    If ($Method -eq 1)","    {","        If (Test-Path $ADFileName)","        {","            $worksheet = $workbook.Worksheets.Item(1)","            $TxtConnector = (\"TEXT;\" + $ADFileName)","            $CellRef = $worksheet.Range(\"A1\")","            #Build, use and remove the text file connector","            $Connector = $worksheet.QueryTables.add($TxtConnector, $CellRef)","","            #65001: Unicode (UTF-8)","            $worksheet.QueryTables.item($Connector.name).TextFilePlatform = 65001","            $worksheet.QueryTables.item($Connector.name).TextFileCommaDelimiter = $True","            $worksheet.QueryTables.item($Connector.name).TextFileParseType = 1","            $worksheet.QueryTables.item($Connector.name).Refresh() | Out-Null","            $worksheet.QueryTables.item($Connector.name).delete()","","            Get-ADRExcelComObjRelease -ComObjtoRelease $CellRef","            Remove-Variable CellRef","            Get-ADRExcelComObjRelease -ComObjtoRelease $Connector","            Remove-Variable Connector","","            $listObject = $worksheet.ListObjects.Add([Microsoft.Office.Interop.Excel.XlListObjectSourceType]::xlSrcRange, $worksheet.UsedRange, $null, [Microsoft.Office.Interop.Excel.XlYesNoGuess]::xlYes, $null)","            $listObject.TableStyle = \"TableStyleLight2\" # Style Cheat Sheet: https://msdn.microsoft.com/en-au/library/documentformat.openxml.spreadsheet.tablestyle.aspx","            $worksheet.UsedRange.EntireColumn.AutoFit() | Out-Null","        }","        Remove-Variable ADFileName","    }","    Elseif ($Method -eq 2)","    {","        $worksheet = $workbook.Worksheets.Item(1)","        If (Test-Path $ADFileName)","        {","            $ADTemp = Import-Csv -Path $ADFileName","            $ADTemp | ForEach-Object {","                Foreach ($prop in $_.PSObject.Properties)","                {","                    $worksheet.Cells.Item($row, $column) = $prop.Name","                    $worksheet.Cells.Item($row, $column + 1) = $prop.Value","                    $row++","                }","            }","            Remove-Variable ADTemp","            $listObject = $worksheet.ListObjects.Add([Microsoft.Office.Interop.Excel.XlListObjectSourceType]::xlSrcRange, $worksheet.UsedRange, $null, [Microsoft.Office.Interop.Excel.XlYesNoGuess]::xlYes, $null)","            $listObject.TableStyle = \"TableStyleLight2\" # Style Cheat Sheet: https://msdn.microsoft.com/en-au/library/documentformat.openxml.spreadsheet.tablestyle.aspx","            $usedRange = $worksheet.UsedRange","            $usedRange.EntireColumn.AutoFit() | Out-Null","        }","        Else","        {","            $worksheet.Cells.Item($row, $column) = \"Error!\"","        }","        Remove-Variable ADFileName","    }","    Elseif ($Method -eq 3)","    {","        $worksheet = $workbook.Worksheets.Item(1)","        If (Test-Path $ADFileName)","        {","            $CsvData = Import-Csv -Path $ADFileName","","            $row_output = $row","            $CsvData[0].PsObject.Properties.Name | ForEach {","                $worksheet.Cells.Item($row_output, $column) = $_","                $row_output++","            }","            Remove-Variable row_output","","            $column_output = $column + 1","            $CsvData | ForEach-Object {","                $row_output = $row","                ForEach ($prop_value in $_.PSObject.Properties.Value)","                {","                    $worksheet.Cells.Item($row_output, $column_output) = $prop_value","                    $row_output++","                }","                $column_output++","            }","            Remove-Variable column_output","            Remove-Variable row_output","","            Remove-Variable CsvData","","            $listObject = $worksheet.ListObjects.Add([Microsoft.Office.Interop.Excel.XlListObjectSourceType]::xlSrcRange, $worksheet.UsedRange, $null, [Microsoft.Office.Interop.Excel.XlYesNoGuess]::xlYes, $null)","            $listObject.TableStyle = \"TableStyleLight2\" # Style Cheat Sheet: https://msdn.microsoft.com/en-au/library/documentformat.openxml.spreadsheet.tablestyle.aspx","            $usedRange = $worksheet.UsedRange","            $usedRange.EntireColumn.AutoFit() | Out-Null","        }","        Else","        {","            $worksheet.Cells.Item($row, $column) = \"Error!\"","        }","        Remove-Variable ADFileName","","    }","    $excel.ScreenUpdating = $true","","    Get-ADRExcelComObjRelease -ComObjtoRelease $worksheet","    Remove-Variable worksheet","}","","# Thanks Anant Shrivastava for the suggestion of using Pivot Tables for generation of the Stats sheets.","Function Get-ADRExcelPivotTable","{","\u003c#",".SYNOPSIS","    Helper to add Pivot Table to the current WorkSheet.","",".DESCRIPTION","    Helper to add Pivot Table to the current WorkSheet.","",".PARAMETER SrcSheetName","    [string]","    Source Sheet Name.","",".PARAMETER PivotTableName","    [string]","    Pivot Table Name.","",".PARAMETER PivotRows","    [array]","    Row names from Source Sheet.","",".PARAMETER PivotColumns","    [array]","    Column names from Source Sheet.","",".PARAMETER PivotFilters","    [array]","    Row/Column names from Source Sheet to use as filters.","",".PARAMETER PivotValues","    [array]","    Row/Column names from Source Sheet to use for Values.","",".PARAMETER PivotPercentage","    [array]","    Row/Column names from Source Sheet to use for Percentage.","",".PARAMETER PivotLocation","    [array]","    Location of the Pivot Table in Row/Column.","#\u003e","    param (","        [Parameter(Mandatory = $true)]","        [string] $SrcSheetName,","","        [Parameter(Mandatory = $true)]","        [string] $PivotTableName,","","        [Parameter(Mandatory = $false)]","        [array] $PivotRows,","","        [Parameter(Mandatory = $false)]","        [array] $PivotColumns,","","        [Parameter(Mandatory = $false)]","        [array] $PivotFilters,","","        [Parameter(Mandatory = $false)]","        [array] $PivotValues,","","        [Parameter(Mandatory = $false)]","        [array] $PivotPercentage,","","        [Parameter(Mandatory = $false)]","        [string] $PivotLocation = \"R1C1\"","    )","","    $excel.ScreenUpdating = $false","    $SrcWorksheet = $workbook.Sheets.Item($SrcSheetName)","    $workbook.ShowPivotTableFieldList = $false","","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/xlpivottablesourcetype-enumeration-excel","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/xlpivottableversionlist-enumeration-excel","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/xlpivotfieldorientation-enumeration-excel","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/constants-enumeration-excel","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/xlsortorder-enumeration-excel","    # https://msdn.microsoft.com/en-us/vba/excel-vba/articles/xlpivotfiltertype-enumeration-excel","","    # xlDatabase = 1 # this just means local sheet data","    # xlPivotTableVersion12 = 3 # Excel 2007","    $PivotFailed = $false","    Try","    {","        $PivotCaches = $workbook.PivotCaches().Create([Microsoft.Office.Interop.Excel.XlPivotTableSourceType]::xlDatabase, $SrcWorksheet.UsedRange, [Microsoft.Office.Interop.Excel.XlPivotTableVersionList]::xlPivotTableVersion12)","    }","    Catch","    {","        $PivotFailed = $true","        Write-Verbose \"[PivotCaches().Create] Failed\"","        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","    }","    If ( $PivotFailed -eq $true )","    {","        $rows = $SrcWorksheet.UsedRange.Rows.Count","        If ($SrcSheetName -eq \"Computer SPNs\")","        {","            $PivotCols = \"A1:C\"","        }","        ElseIf ($SrcSheetName -eq \"Computers\")","        {","            $PivotCols = \"A1:F\"","        }","        ElseIf ($SrcSheetName -eq \"Users\")","        {","            $PivotCols = \"A1:C\"","        }","        $UsedRange = $SrcWorksheet.Range($PivotCols+$rows)","        $PivotCaches = $workbook.PivotCaches().Create([Microsoft.Office.Interop.Excel.XlPivotTableSourceType]::xlDatabase, $UsedRange, [Microsoft.Office.Interop.Excel.XlPivotTableVersionList]::xlPivotTableVersion12)","        Remove-Variable rows","\t    Remove-Variable PivotCols","        Remove-Variable UsedRange","    }","    Remove-Variable PivotFailed","    $PivotTable = $PivotCaches.CreatePivotTable($PivotLocation,$PivotTableName)","    # $workbook.ShowPivotTableFieldList = $true","","    If ($PivotRows)","    {","        ForEach ($Row in $PivotRows)","        {","            $PivotField = $PivotTable.PivotFields($Row)","            $PivotField.Orientation = [Microsoft.Office.Interop.Excel.XlPivotFieldOrientation]::xlRowField","        }","    }","","    If ($PivotColumns)","    {","        ForEach ($Col in $PivotColumns)","        {","            $PivotField = $PivotTable.PivotFields($Col)","            $PivotField.Orientation = [Microsoft.Office.Interop.Excel.XlPivotFieldOrientation]::xlColumnField","        }","    }","","    If ($PivotFilters)","    {","        ForEach ($Fil in $PivotFilters)","        {","            $PivotField = $PivotTable.PivotFields($Fil)","            $PivotField.Orientation = [Microsoft.Office.Interop.Excel.XlPivotFieldOrientation]::xlPageField","        }","    }","","    If ($PivotValues)","    {","        ForEach ($Val in $PivotValues)","        {","            $PivotField = $PivotTable.PivotFields($Val)","            $PivotField.Orientation = [Microsoft.Office.Interop.Excel.XlPivotFieldOrientation]::xlDataField","        }","    }","","    If ($PivotPercentage)","    {","        ForEach ($Val in $PivotPercentage)","        {","            $PivotField = $PivotTable.PivotFields($Val)","            $PivotField.Orientation = [Microsoft.Office.Interop.Excel.XlPivotFieldOrientation]::xlDataField","            $PivotField.Calculation = [Microsoft.Office.Interop.Excel.XlPivotFieldCalculation]::xlPercentOfTotal","            $PivotTable.ShowValuesRow = $false","        }","    }","","    # $PivotFields.Caption = \"\"","    $excel.ScreenUpdating = $true","","    Get-ADRExcelComObjRelease -ComObjtoRelease $PivotField","    Remove-Variable PivotField","    Get-ADRExcelComObjRelease -ComObjtoRelease $PivotTable","    Remove-Variable PivotTable","    Get-ADRExcelComObjRelease -ComObjtoRelease $PivotCaches","    Remove-Variable PivotCaches","    Get-ADRExcelComObjRelease -ComObjtoRelease $SrcWorksheet","    Remove-Variable SrcWorksheet","}","","Function Get-ADRExcelAttributeStats","{","\u003c#",".SYNOPSIS","    Helper to add Attribute Stats to the current WorkSheet.","",".DESCRIPTION","    Helper to add Attribute Stats to the current WorkSheet.","",".PARAMETER SrcSheetName","    [string]","    Source Sheet Name.","",".PARAMETER Title1","    [string]","    Title1.","",".PARAMETER PivotTableName","    [string]","    PivotTableName.","",".PARAMETER PivotRows","    [string]","    PivotRows.","",".PARAMETER PivotValues","    [string]","    PivotValues.","",".PARAMETER PivotPercentage","    [string]","    PivotPercentage.","",".PARAMETER Title2","    [string]","    Title2.","",".PARAMETER ObjAttributes","    [OrderedDictionary]","    Attributes.","#\u003e","    param (","        [Parameter(Mandatory = $true)]","        [string] $SrcSheetName,","","        [Parameter(Mandatory = $true)]","        [string] $Title1,","","        [Parameter(Mandatory = $true)]","        [string] $PivotTableName,","","        [Parameter(Mandatory = $true)]","        [string] $PivotRows,","","        [Parameter(Mandatory = $true)]","        [string] $PivotValues,","","        [Parameter(Mandatory = $true)]","        [string] $PivotPercentage,","","        [Parameter(Mandatory = $true)]","        [string] $Title2,","","        [Parameter(Mandatory = $true)]","        [System.Object] $ObjAttributes","    )","","    $excel.ScreenUpdating = $false","    $worksheet = $workbook.Worksheets.Item(1)","    $SrcWorksheet = $workbook.Sheets.Item($SrcSheetName)","","    $row = 1","    $column = 1","    $worksheet.Cells.Item($row, $column) = $Title1","    $worksheet.Cells.Item($row,$column).Style = \"Heading 2\"","    $worksheet.Cells.Item($row,$column).HorizontalAlignment = -4108","    $MergeCells = $worksheet.Range(\"A1:C1\")","    $MergeCells.Select() | Out-Null","    $MergeCells.MergeCells = $true","    Remove-Variable MergeCells","","    Get-ADRExcelPivotTable -SrcSheetName $SrcSheetName -PivotTableName $PivotTableName -PivotRows @($PivotRows) -PivotValues @($PivotValues) -PivotPercentage @($PivotPercentage) -PivotLocation \"R2C1\"","    $excel.ScreenUpdating = $false","","    $row = 2","    \"Type\",\"Count\",\"Percentage\" | ForEach-Object {","        $worksheet.Cells.Item($row, $column) = $_","        $worksheet.Cells.Item($row, $column).Font.Bold = $True","        $column++","    }","","    $row = 3","    $column = 1","    For($row = 3; $row -le 6; $row++)","    {","        $temptext = [string] $worksheet.Cells.Item($row, $column).Text","        switch ($temptext.ToUpper())","        {","            \"TRUE\" { $worksheet.Cells.Item($row, $column) = \"Enabled\" }","            \"FALSE\" { $worksheet.Cells.Item($row, $column) = \"Disabled\" }","            \"GRAND TOTAL\" { $worksheet.Cells.Item($row, $column) = \"Total\" }","        }","    }","","    If ($ObjAttributes)","    {","        $row = 1","        $column = 6","        $worksheet.Cells.Item($row, $column) = $Title2","        $worksheet.Cells.Item($row,$column).Style = \"Heading 2\"","        $worksheet.Cells.Item($row,$column).HorizontalAlignment = -4108","        $MergeCells = $worksheet.Range(\"F1:L1\")","        $MergeCells.Select()