ber -MemberType NoteProperty -Name \"whenCreated\" -Value ([DateTime] $($_.whenCreated))","                $Obj | Add-Member -MemberType NoteProperty -Name \"whenChanged\" -Value ([DateTime] $($_.whenChanged))","                $ADTrustObj += $Obj","            }","            Remove-Variable ADTrusts","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectClass=trustedDomain)\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"trustpartner\",\"trustdirection\",\"trusttype\",\"trustattributes\",\"whencreated\",\"whenchanged\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADTrusts = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRTrust] Error while enumerating trustedDomain Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADTrusts)","        {","            Write-Verbose \"[*] Total Trusts: $([ADRecon.LDAPClass]::ObjectCount($ADTrusts))\"","            # Trust Info","            $ADTrustObj = @()","            $ADTrusts | ForEach-Object {","                # Create the object for each instance.","                $Obj = New-Object PSObject","                $Obj | Add-Member -MemberType NoteProperty -Name \"Source Domain\" -Value $(Get-DNtoFQDN ([string] $_.Properties.distinguishedname))","                $Obj | Add-Member -MemberType NoteProperty -Name \"Target Domain\" -Value $([string] $_.Properties.trustpartner)","                $TrustDirection = [string] $TDAD[$_.Properties.trustdirection]","                $Obj | Add-Member -MemberType NoteProperty -Name \"Trust Direction\" -Value $TrustDirection","                $TrustType = [string] $TTAD[$_