tObj += $Obj","            }","            Remove-Variable ADTrusts","        }","    }","","    If ($ADTrustObj)","    {","        Return $ADTrustObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRSite","{","\u003c#",".SYNOPSIS","    Returns the Sites of the current (or specified) domain.","",".DESCRIPTION","    Returns the Sites of the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER objDomainRootDSE","    [DirectoryServices.DirectoryEntry]","    RootDSE Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomainRootDSE,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $SearchPath = \"CN=Sites\"","            $ADSites = Get-ADObject -SearchBase \"$SearchPath,$((Get-ADRootDSE).configurationNamingContext)\" -LDAPFilter \"(objectClass=site)\" -Properties Name,Description,whenCreated,whenChanged","        }","        Catch","        {","            Write-Warning \"[Get-ADRSite] Error while enumerating Site Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        