      If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$SearchPath,$($objDomainRootDSE.ConfigurationNamingContext)\", $Credential.UserName,$Credential.GetNetworkCredential().Password","        }","        Else","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$SearchPath,$($objDomainRootDSE.ConfigurationNamingContext)\"","        }","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","        $ObjSearcher.Filter = \"(objectClass=subnet)\"","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADSubnets = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRSubnet] Error while enumerating Subnet Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADSubnets)","        {","            Write-Verbose \"[*] Total Subnets: $([ADRecon.LDAPClass]::ObjectCount($ADSubnets))\"","            # Subnets Info","            $ADSubnetObj = @()","            $ADSubnets | ForEach-Object {","                # Create the object for each instance.","                $Obj = New-Object PSObject","                $Obj | Add-Member -MemberType NoteProperty -Name \"Site\" -Value $((([string] $_.Properties.siteobject) -Split \",\")[0] -replace 'CN=','')","                $Obj | Add-Member -MemberType NoteProperty -Name \"Name\" -Value $([string] $_.Properties.name)","                $Obj | Add-Member -MemberType NoteProperty -Name \"Description\" -Value $([string] $_.Properties.description)","                $Obj | Add-Member -MemberType NoteProperty -Name \"whenCreated\" -Value ([DateTime] $($_.Properties.whencreated))","                $Obj | Add-Member -MemberType NoteProperty -Name \"whenChanged\" -Value ([DateTime] $($_.Properties.whenchanged))","                $ADSubnetObj += $Obj","            }","            Remove-Variable ADSubnets","        }","    }","","    If ($ADSubnetObj)","    {","        Return $ADSubnetObj","    }","    Else","    {","        Return $null","    }","}","","# based on https://blogs.technet.microsoft.com/heyscriptingguy/2012/01/05/how-to-find-active-directory-schema-update-history-by-using-powershell/","Function Get-ADRSchemaHistory","{","\u003c#",".SYNOPSIS","    Returns the Schema History of the current (or specified) domain.","",".DESCRIPTION","    Returns the Schema History of the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER objDomainRootDSE","    [DirectoryServices.DirectoryEntry]","    RootDSE Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomainRootDSE,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADSchemaHistory = @( Get-ADObject -SearchBase ((Get-ADRootDSE).schemaNamingContext) -SearchScope OneLevel -Filter * -Property DistinguishedName, Name, ObjectClass, whenChanged, whenCreated )","        }","        Catch","        {","            Write-Warning \"[Get-ADRSchemaHistory] Error while enumerating Schema Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADSchemaHistory)","        {","            Write-Verbose \"[*] Total Schema Objects: $([ADRecon.ADWSClass]::ObjectCount($ADSchemaHistory))\"","            $ADSchemaObj = [ADRecon.ADWSClass]::SchemaParser($ADSchemaHistory, $Threads)","            Remove-Variable ADSchemaHistory","        }","    }","","    If ($Method -eq 'LDAP')","    {","        If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$($objDomainRootDSE.schemaNamingContext)\", $Credential.UserName,$Credential.GetNetworkCredential().Password","        }","        Else","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($objDomainRootDSE.schemaNamingContext)\"","        }","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","        $ObjSearcher.Filter = \"(objectClass=*)\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"name\",\"objectclass\",\"whenchanged\",\"whencreated\"))","        $ObjSearcher.SearchScope = \"OneLevel\"","","        Try","        {","            $ADSchemaHistory = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRSchemaHistory] Error while enumerating Schema Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADSchemaHistory)","        {","            Write-Verbose \"[*] Total Schema Objects: $([ADRecon.LDAPClass]::ObjectCount($ADSchemaHistory))\"","            $ADSchemaObj = [ADRecon.LDAPClass]::SchemaParser($ADSchemaHistory, $Threads)","            Remove-Variable ADSchemaHistory","        }","    }","","    If ($ADSchemaObj)","    {","        Return $ADSchemaObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRDefaultPasswordPolicy","{","\u003c#",".SYNOPSIS","    Returns the Default Password Policy of the current (or specified) domain.","",".DESCRIPTION","    Returns the Default Password Policy of the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADpasspolicy = Get-ADDefaultDomainPasswordPolicy","        }","        Catch","        {","            Write-Warning \"[Get-ADRDefaultPasswordPolicy] Error while enumerating the Default Password Policy\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADpasspolicy)","        {","            $ObjValues = @( \"Enforce password history (passwords)\", $ADpasspolicy.PasswordHistoryCount, \"4\", \"4\", \"Req. 8.2.5 / 8.3.7\", \"N/A\", \"-\", \"24 or more\",","            \"Maximum password age (days)\", $ADpasspolicy.MaxPasswordAge.days, \"90\", \"90\", \"Req. 8.2.4 / 8.3.9\", \"365\", \"ISM-1590 Rev:1 Mar22\", \"1 to 365\",","            \"Minimum password age (days)\", $ADpasspolicy.MinPasswordAge.days, \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", \"1 or more\",","            \"Minimum password length (characters)\", $ADpasspolicy.MinPasswordLength, \"7\", \"12\", \"Req. 8.2.3 / 8.3.6\", \"14\", \"Control: ISM-0421 Rev:8 Dec21\", \"14 or more\",","            \"Password must meet complexity requirements\", $ADpasspolicy.ComplexityEnabled, $true, $true, \"Req. 8.2.3 / 8.3.6\", \"N/A\", \"-\", $true,","            \"Store password using reversible encryption for all users in the domain\", $ADpasspolicy.ReversibleEncryptionEnabled, \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", $false,","            \"Account lockout duration (mins)\", $ADpasspolicy.LockoutDuration.minutes, \"0 (manual unlock) or 30\", \"0 (manual unlock) or 30\", \"Req. 8.1.7 / 8.3.4\", \"N/A\", \"-\", \"15 or more\",","            \"Account lockout threshold (attempts)\", $ADpasspolicy.LockoutThreshold, \"1 to 6\", \"1 to 10\", \"Req. 8.1.6 / 8.3.4\", \"1 to 5\", \"Control: ISM-1403 Rev:2 Oct19\", \"1 to 5\",","            \"Reset account lockout counter after (mins)\", $ADpasspolicy.LockoutObservationWindow.minutes, \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", \"15 or more\" )","","            Remove-Variable ADpasspolicy","        }","    }","","    If ($Method -eq 'LDAP')","    {","        If ($ObjDomain)","        {","            #Value taken from https://msdn.microsoft.com/en-us/library/ms679431(v=vs.85).aspx","            $pwdProperties = @{","                \"DOMAIN_PASSWORD_COMPLEX\" = 1;","                \"DOMAIN_PASSWORD_NO_ANON_CHANGE\" = 2;","                \"DOMAIN_PASSWORD_NO_CLEAR_CHANGE\" = 4;","                \"DOMAIN_LOCKOUT_ADMINS\" = 8;","                \"DOMAIN_PASSWORD_STORE_CLEARTEXT\" = 16;","                \"DOMAIN_REFUSE_PASSWORD_CHANGE\" = 32","            }","","            If (($ObjDomain.pwdproperties.value -band $pwdProperties[\"DOMAIN_PASSWORD_COMPLEX\"]) -eq $pwdProperties[\"DOMAIN_PASSWORD_COMPLEX\"])","            {","                $ComplexPasswords = $true","            }","            Else","            {","                $ComplexPasswords = $false","            }","","            If (($ObjDomain.pwdproperties.value -band $pwdProperties[\"DOMAIN_PASSWORD_STORE_CLEARTEXT\"]) -eq $pwdProperties[\"DOMAIN_PASSWORD_STORE_CLEARTEXT\"])","            {","                $ReversibleEncryption = $true","            }","            Else","            {","                $ReversibleEncryption = $false","            }","","            $LockoutDuration = $($ObjDomain.ConvertLargeIntegerToInt64($ObjDomain.lockoutduration.value)/-600000000)","","            If ($LockoutDuration -gt 99999)","            {","                $LockoutDuration = 0","            }","","            $ObjValues = @( \"Enforce password history (passwords)\", $ObjDomain.PwdHistoryLength.value, \"4\", \"4\", \"Req. 8.2.5 / 8.3.7\", \"N/A\", \"-\", \"24 or more\",","                \"Maximum password age (days)\", $($ObjDomain.ConvertLargeIntegerToInt64($ObjDomain.maxpwdage.value) / -864000000000), \"90\", \"90\", \"Req. 8.2.4 / 8.3.9\", \"365\", \"ISM-1590 Rev:1 Mar22\", \"1 to 365\",","            \"Minimum password age (days)\", $($ObjDomain.ConvertLargeIntegerToInt64($ObjDomain.minpwdage.value) /-864000000000), \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", \"1 or more\",","            \"Minimum password length (characters)\", $ObjDomain.MinPwdLength.value, \"7\", \"12\", \"Req. 8.2.3 / 8.3.6\", \"14\", \"Control: ISM-0421 Rev:8 Dec21\", \"14 or more\",","            \"Password must meet complexity requirements\", $ComplexPasswords, $true, $true, \"Req. 8.2.3 / 8.3.6\", \"N/A\", \"-\", $true,","            \"Store password using reversible encryption for all users in the domain\", $ReversibleEncryption, \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", $false,","            \"Account lockout duration (mins)\", $LockoutDuration, \"0 (manual unlock) or 30\", \"0 (manual unlock) or 30\", \"Req. 8.1.7 / 8.3.4\", \"N/A\", \"-\", \"15 or more\",","            \"Account lockout threshold (attempts)\", $ObjDomain.LockoutThreshold.value, \"1 to 6\", \"1 to 10\", \"Req. 8.1.6 / 8.3.4\", \"1 to 5\", \"Control: ISM-1403 Rev:2 Oct19\", \"1 to 5\",","            \"Reset account lockout counter after (mins)\", $($ObjDomain.ConvertLargeIntegerToInt64($ObjDomain.lockoutobservationWindow.value)/-600000000), \"N/A\", \"N/A\", \"-\", \"N/A\", \"-\", \"15 or more\" )","","            Remove-Variable pwdProperties","            Remove-Variable ComplexPasswords","            Remove-Variable ReversibleEncryption","        }","    }","","    If ($ObjValues)","    {","        $ADPassPolObj = @()","        For ($i = 0; $i -lt $($ObjValues.Count); $i++)","        {","            $Obj = New-Object PSObject","            $Obj | Add-Member -MemberType NoteProperty -Name \"Policy\" -Value $ObjValues[$i]","            $Obj | Add-Member -MemberType NoteProperty -Name \"Current Value\" -Value $ObjValues[$i+1]","            $Obj | Add-Member -MemberType NoteProperty -Name \"PCI DSS v3.2.1\" -Value $ObjValues[$i+2]","            $Obj | Add-Member -MemberType NoteProperty -Name \"PCI DSS v4.0\" -Value $ObjValues[$i+3]","            $Obj | Add-Member -MemberType NoteProperty -Name \"PCI DSS Requirement\" -Value $ObjValues[$i+4]","            $Obj | Add-Member -MemberType NoteProperty -Name \"ACSC ISM\" -Value $ObjValues[$i+5]","            $Obj | Add-Member -MemberType NoteProperty -Name \"ISM Controls 16Jun2022\" -Value $ObjValues[$i+6]","            $Obj | Add-Member -MemberType NoteProperty -Name \"CIS Benchmark 2022\" -Value $ObjValues[$i+7]","            $i += 7","            $ADPassPolObj += $Obj","        }","        Remove-Variable ObjValues","        Return $ADPassPolObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRFineGrainedPasswordPolicy","{","\u003c#",".SYNOPSIS","    Returns the Fine Grained Password Policy of the current (or specified) domain.","",".DESCRIPTION","    Returns the Fine Grained Password Policy of the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADFinepasspolicy = Get-ADFineGrainedPasswordPolicy -Filter *","        }","        Catch","        {","            Write-Warning \"[Get-ADRFineGrainedPasswordPolicy] Error while enumerating the Fine Grained Password Policy\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADFinepasspolicy)","        {","            $FgppPassPolObj = @()","","            $ADFinepasspolicy | ForEach-Object {","                $AppliesTo = \"\"","                $AppliesTo = $_.AppliesTo -join \", \"","","                $FgppValues = [ordered]@{","                    \"Name\"                                       = $($_.Name)","                    \"Applies To\"                                 = $AppliesTo","                    \"Enforce password history\"                   = $_.PasswordHistoryCount","                    \"Maximum password age (days)\"                = $_.MaxPasswordAge.days","                    \"Minimum password age (days)\"                = $_.MinPasswordAge.days","                    \"Minimum password length\"                    = $_.MinPasswordLength","                    \"Password must meet complexity requirements\" = $_.ComplexityEnabled","                    \"Store password using reversible encryption\" = $_.ReversibleEncryptionEnabled","                    \"Account lockout duration (mins)\"            = $_.LockoutDuration.minutes","                    \"Account lockout threshold\"                  = $_.LockoutThreshold","                    \"Reset account lockout counter after (mins)\" = $_.LockoutObservationWindow.minutes","                    \"Precedence\"                                 = $($_.Precedence)","                }","","                $FgppObj = New-Object -TypeName PsObject -Property $FgppValues","                $FgppPassPolObj += $FgppObj","            }","            Remove-Variable ADFinepasspolicy","        }","    }","","    If ($Method -eq 'LDAP')","    {","        If ($ObjDomain)","        {","            $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","            $ObjSearcher.PageSize = $PageSize","            $ObjSearcher.Filter = \"(objectClass=msDS-PasswordSettings)\"","            $ObjSearcher.SearchScope = \"Subtree\"","            Try","            {","                $ADFinepasspolicy = $ObjSearcher.FindAll()","            }","            Catch","            {","                Write-Warning \"[Get-ADRFineGrainedPasswordPolicy] Error while enumerating the Fine Grained Password Policy\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                Return $null","            }","","            If ($ADFinepasspolicy)","            {","                If ([ADRecon.LDAPClass]::ObjectCount($ADFinepasspolicy) -ge 1)","                {","                    $FgppPassPolObj = @()","                    $ADFinepasspolicy | ForEach-Object {","                        $AppliesTo = \"\"","                        $AppliesTo = $_.Properties.'msds-psoappliesto' -join \", \"","","                        $FgppValues = [ordered]@{","                            \"Name\"                                       = $($_.Properties.name)","                            \"Applies To\"                                 = $AppliesTo","                            \"Enforce password history\"                   = $($_.Properties.'msds-passwordhistorylength')","                            \"Maximum password age (days)\"                = $($($_.Properties.'msds-maximumpasswordage') /-864000000000)","                            \"Minimum password age (days)\"                = $($($_.Properties.'msds-minimumpasswordage') /-864000000000)","                            \"Minimum password length\"                    = $($_.Properties.'msds-minimumpasswordlength')","                            \"Password must meet complexity requirements\" = $($_.Properties.'msds-passwordcomplexityenabled')","                            \"Store password using reversible encryption\" = $($_.Properties.'msds-passwordreversibleencryptionenabled')","                            \"Account lockout duration (mins)\"            = $($($_.Properties.'msds-lockoutduration')/-600000000)","                            \"Account lockout threshold\"                  = $($_.Properties.'msds-lockoutthreshold')","                            \"Reset account lockout counter after (mins)\" = $($($_.Properties.'msds-lockoutobservationwindow')/-600000000)","                            \"Precedence\"                                 = $($_.Properties.'msds-passwordsettingsprecedence')","                        }","","                        $FgppObj = New-Object -TypeName PsObject -Property $FgppValues","                        $FgppPassPolObj += $FgppObj","                    }","                }","                Remove-Variable ADFinepasspolicy","            }","        }","    }","","    If ($FgppPassPolObj)","    {","        Return $FgppPassPolObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRDomainController","{","\u003c#",".SYNOPSIS","    Returns the domain controllers for the current (or specified) forest.","",".DESCRIPTION","    Returns the domain controllers for the current (or specified) forest.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADDomainControllers = @( Get-ADDomainController -Filter * )","        }","        Catch","        {","            Write-Warning \"[Get-ADRDomainController] Error while enumerating DomainController Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        # DC Info","        If ($ADDomainControllers)","        {","            Write-Verbose \"[*] Total Domain Controllers: $([ADRecon.ADWSClass]::ObjectCount($ADDomainControllers))\"","            $DCObj = [ADRecon.ADWSClass]::DomainControllerParser($ADDomainControllers, $Threads)","            Remove-Variable ADDomainControllers","        }","    }","","    If ($Method -eq 'LDAP')","    {","        If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $DomainFQDN = Get-DNtoFQDN($objDomain.distinguishedName)","            $DomainContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext(\"Domain\",$($DomainFQDN),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","            Try","            {","                $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetDomain($DomainContext)","            }","            Catch","            {","                Write-Warning \"[Get-ADRDomainController] Error getting Domain Context\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                Return $null","            }","            Remove-Variable DomainContext","        }","        Else","        {","            $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()","        }","","        If ($ADDomain.DomainControllers)","        {","            Write-Verbose \"[*] Total Domain Controllers: $([ADRecon.LDAPClass]::ObjectCount($ADDomain.DomainControllers))\"","            $DCObj = [ADRecon.LDAPClass]::DomainControllerParser($ADDomain.DomainControllers, $Threads)","            Remove-Variable ADDomain","        }","    }","","    If ($DCObj)","    {","        Return $DCObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRUser","{","\u003c#",".SYNOPSIS","    Returns all users and/or service principal name (SPN) in the current (or specified) domain.","",".DESCRIPTION","    Returns all users and/or  service principal name (SPN) in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER date","    [DateTime]","    Date when ADRecon was executed.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER DormantTimeSpan","    [int]","    Timespan for Dormant accounts. Default 90 days.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".PARAMETER ADRUsers","    [bool]","",".PARAMETER ADRUserSPNs","    [bool]","",".PARAMETER OnlyEnabled","    [bool]","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $true)]","        [DateTime] $date,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $true)]","        [int] $DormantTimeSpan = 90,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","        [int] $