] $objDomain,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADUsers = Get-ADObject -LDAPFilter '(|(UserPassword=*)(UnixUserPassword=*)(unicodePwd=*)(msSFU30Password=*))' -ResultPageSize $PageSize -Properties *","        }","        Catch","        {","            Write-Warning \"[Get-ADRPasswordAttributes] Error while enumerating Password Attributes\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADUsers)","        {","            Write-Warning \"[*] Total PasswordAttribute Objects: $([ADRecon.ADWSClass]::ObjectCount($ADUsers))\"","            $UserObj = $ADUsers","            Remove-Variable ADUsers","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(|(UserPassword=*)(UnixUserPassword=*)(unicodePwd=*)(msSFU30Password=*))\"","        $ObjSearcher.SearchScope = \"Subtree\"","        Try","        {","            $ADUsers = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRPasswordAttributes] Error while enumerating Password Attributes\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADUsers)","        {","            $cnt = [ADRecon.LDAPClass]::ObjectCount($ADUsers)","            If ($cnt -gt 0)","            {","                Write-Warning \"[*] Total PasswordAttribute Objects: $cnt\"","            }","            $UserObj = $ADUsers","            Remove-Variable ADUsers","        }","    }","","    If ($UserObj)","    {","        Return $UserObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRGroup","{","\