ain","        }","        Catch","        {","            Write-Warning \"[Get-ADRGroupMember] Error getting Domain Context\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        Try","        {","            $ADGroups = $ADGroups = @( Get-ADGroup -Filter * -ResultPageSize $PageSize -Properties SamAccountName,SID )","        }","        Catch","        {","            Write-Warning \"[Get-ADRGroupMember] Error while enumerating Group Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        Try","        {","            $ADGroupMembers = @( Get-ADObject -LDAPFilter '(|(memberof=*)(primarygroupid=*))' -Properties DistinguishedName,ObjectClass,memberof,primaryGroupID,sAMAccountName,samaccounttype, objectSid )","        }","        Catch","        {","            Write-Warning \"[Get-ADRGroupMember] Error while enumerating GroupMember Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ( ($ADDomainSID) -and ($ADGroups) -and ($ADGroupMembers) )","        {","            Write-Verbose \"[*] Total GroupMember Objects: $([ADRecon.ADWSClass]::ObjectCount($ADGroupMembers))\"","            $GroupMemberObj = [ADRecon.ADWSClass]::GroupMemberParser($ADGroups, $ADGroupMembers, $ADDomainSID, $Threads)","            Remove-Variable ADGroups","            Remove-Variable ADGroupMembers","            Remove-Variable ADDomainSID","        }","    }","","    If ($Method -eq 'LDAP')","    {","","        If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $DomainFQDN = Get-DNtoFQDN($objDomain.distinguishedName)","            $DomainContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext(\"Domain\",$($DomainFQDN),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","            Try","            {","                $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetDomain($DomainContext)","            }","            Catch","            {","                Write-Warning \"[Get-ADRGroupMember] Error getting Domain Context\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                Return $null","            }","            Remove-Variable DomainContext","            Try","            {","                $ForestContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext(\"Forest\",$($ADDomain.Forest),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","                $ADForest = [System.DirectoryServices.ActiveDirectory.Forest]::GetForest($ForestContext)","            }","            Catch","            {","                Write-Warning \"[Get-ADRGroupMember] Error getting Forest Context\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","            If ($ForestContext)","            {","                Remove-Variable ForestContext","            }","            If ($ADForest)","            {","                $GlobalCatalog = $ADForest.FindGlobalCatalog()","            }","            If ($GlobalCatalog)","            {","                $DN = \"GC://$($GlobalCatalog.IPAddress)/$($objDomain.distinguishedname)\"","                Try","                {","                    $ADObject = New-Object -TypeName System.DirectoryServices.DirectoryEntry -ArgumentList ($($DN),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","                    $ADDomainSID = New-Object System.Security.Principal.SecurityIdentifier($ADObject.objectSid[0], 0)","                    $ADObject.Dispose()","                }","                Catch","                {","                    Write-Warning \"[Get-ADRGroupMember] Error retrieving Domain SID using the GlobalCatalog $($GlobalCatalog.IPAddress). Using SID from the ObjDomain.\"","                    Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                    $ADDomainSID = New-Object System.Security.Principal.SecurityIdentifier($objDomain.objectSid[0], 0)","                }","            }","            Else","            {","                $ADDomainSID = New-Object System.Security.Principal.SecurityIdentifier($objDomain.objectSid[0], 0)","            }","        }","        Else","        {","            $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()","            $ADForest = [System.DirectoryServices.ActiveDirectory.Forest]::GetCurrentForest()","            Try","            {","                $GlobalCatalog = $ADForest.FindGlobalCatalog()","                $DN = \"GC://$($GlobalCatalog)/$($objDomain.distinguishedname)\"","                $ADObject = New-Object -TypeName System.DirectoryServices.DirectoryEntry -ArgumentList ($DN)","                $ADDomainSID = New-Object System.Security.Principal.SecurityIdentifier($ADObject.objectSid[0], 0)","                $ADObject.dispose()","            }","            Catch","            {","                Write-Warning \"[Get-ADRGroupMember] Error retrieving Domain SID using the GlobalCatalog $($GlobalCatalog.IPAddress). Using SID from the ObjDomain.\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                $ADDomainSID = New-Object System.Security.Principal.SecurityIdentifier($objDomain.objectSid[0], 0)","            }","        }","","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectClass=group)\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"samaccountname\", \"objectsid\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADGroups = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGroupMember] Error while enumerating Group Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(|(memberof=*)(primarygroupid=*))\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\", \"dnshostname\", \"objectclass\", \"primarygroupid\", \"memberof\", \"samaccountname\", \"samaccounttype\", \"objectsid\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADGroupMembers = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGroupMember] Error while enumerating GroupMember Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ( ($ADDomainSID) -and ($ADGroups) -and ($ADGroupMembers) )","        {","            Write-Verbose \"[*] Total GroupMember Objects: $([ADRecon.LDAPClass]::ObjectCount($ADGroupMembers))\"","            $GroupMemberObj = [ADRecon.LDAPClass]::GroupMemberParser($ADGroups, $ADGroupMembers, $ADDomainSID, $Threads)","            Remove-Variable ADGroups","            Remove-Variable ADGroupMembers","            Remove-Variable ADDomainSID","        }","    }","","    If ($GroupMemberObj)","    {","        Return $GroupMemberObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADROU","{","\u003c#",".SYNOPSIS","    Returns all Organizational Units (OU) in the current (or specified) domain.","",".DESCRIPTION","    Returns all Organizational Units (OU) in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry 