$null","        }","        $ObjSearcher.dispose()","","        If ($ADOUs)","        {","            Write-Verbose \"[*] Total OUs: $([ADRecon.LDAPClass]::ObjectCount($ADOUs))\"","            $OUObj = [ADRecon.LDAPClass]::OUParser($ADOUs, $Threads)","            Remove-Variable ADOUs","        }","    }","","    If ($OUObj)","    {","        Return $OUObj","    }","    Else","    {","        Return $null","    }","}","","Function Get-ADRGPO","{","\u003c#",".SYNOPSIS","    Returns all Group Policy Objects (GPO) in the current (or specified) domain.","",".DESCRIPTION","    Returns all Group Policy Objects (GPO) in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","        [int] $Threads = 10","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADGPOs = @( Get-ADObject -LDAPFilter '(objectCategory=groupPolicyContainer)' -Properties DisplayName,DistinguishedName,Name,gPCFileSysPath,whenCreated,whenChanged )","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPO] Error while enumerating groupPolicyContainer Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADGPOs)","        {","            Write-Verbose \"[*] Total GPOs: $([ADRecon.ADWSClass]::ObjectCount($ADGPOs))\"","            $GPOsObj = [ADRecon.ADWSClass]::GPOParser($ADGPOs, $Threads)","            Remove-Variable ADGPOs","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectCategory=groupPolicyContainer)\"","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADGPOs = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPO] Error while enumerating groupPolicyContainer Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADGPOs)","        {","            Write-Verbose \"[*] Total GPOs: $([ADRecon.LDAPClass]::ObjectCount($ADGPOs))\"","            $GPOsObj = [ADRecon.LDAPClass]::GPOParser($ADGPOs, $Threads)","            Remove-Variable ADGPOs","        }","    }","","    If ($GPOsObj)","    {","        Return $GPOsObj","    }","    Else","    {","        Return $null","    }","}","","# based on https://github.com/GoateePFE/GPLinkReport/blob/master/gPLinkReport.ps1","Function Get-ADRGPLink","{","\u003c#",".SYNOPSIS","    Returns all group policy links (gPLink) applied to Scope of Management (SOM) in the current (or specified) domain.","",".DESCRIPTION","    Returns all group policy links (gPLink) applied to Scope of Management (SOM) in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","        [int] $Threads = 10","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADSOMs = @( Get-ADObject -LDAPFilter '(|(objectclass=domain)(objectclass=organizationalUnit))' -Properties DistinguishedName,Name,gPLink,gPOptions )","            $ADSOMs += @( Get-ADObject -SearchBase \"CN=Sites,$((Get-ADRootDSE).configurationNamingContext)\" -LDAPFilter \"(objectclass=site)\" -Properties DistinguishedName,Name,gPLink,gPOptions )","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPLink] Error while enumerating SOM Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        Try","        {","            $ADGPOs = @( Get-ADObject -LDAPFilter '(objectCategory=groupPolicyContainer)' -Properties DisplayName,DistinguishedName )","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPLink] Error while enumerating groupPolicyContainer Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ( ($ADSOMs) -and ($ADGPOs) )","        {","            Write-Verbose \"[*] Total SOMs: $([ADRecon.ADWSClass]::ObjectCount($ADSOMs))\"","            $SOMObj = [ADRecon.ADWSClass]::SOMParser($ADGPOs, $ADSOMs, $Threads)","            Remove-Variable ADSOMs","            Remove-Variable ADGPOs","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $ADSOMs = @()","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(|(objectclass=domain)(objectclass=organizationalUnit))\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"name\",\"gplink\",\"gpoptions\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADSOMs += $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPLink] Error while enumerating SOM Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        $SearchPath = \"CN=Sites\"","        If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$SearchPath,$($objDomainRootDSE.ConfigurationNamingContext)\", $Credential.UserName,$Credential.GetNetworkCredential().Password","        }","        Else","        {","            $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$SearchPath,$($objDomainRootDSE.ConfigurationNamingContext)\"","        }","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","        $ObjSearcher.Filter = \"(objectclass=site)\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"name\",\"gplink\",\"gpoptions\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADSOMs += $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPLink] Error while enumerating SOM Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectCategory=groupPolicyContainer)\"","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADGPOs = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPLink] Error while enumerating groupPolicyContainer Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ( ($ADSOMs) -and ($ADGPOs) )","        {","            Write-Verbose \"[*] Total SOMs: $([ADRecon.LDAPClass]::ObjectCount($ADSOMs))\"","            $SOMObj = [ADRecon.LDAPClass]::SOMParser($ADGPOs, $ADSOMs, $Threads)","            Remove-Variable ADSOMs","            Remove-Variable ADGPOs","        }","    }","","    If ($SOMObj)","    {","        Return $SOMObj","    }","    Else","    {","        Return $null","    }","}","","# Modified Convert-DNSRecord function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","Function Convert-DNSRecord","{","\u003c#",".SYNOPSIS","","Helpers that decodes a binary DNS record blob.","","Author: Michael B. Smith, Will Schroeder (@harmj0y)","License: BSD 3-Clause","Required Dependencies: None","",".DESCRIPTION","","Decodes a binary blob representing an Active Directory DNS entry.","Used by Get-DomainDNSRecord.","","Adapted/ported from Michael B. Smith's code at https://raw.githubusercontent.com/mmessano/PowerShell/master/dns-dump.ps1","",".PARAMETER DNSRecord","","A byte array representing the DNS record.","",".OUTPUTS","","System.Management.Automation.PSCustomObject","","Outputs custom PSObjects with detailed information about the DNS record entry.","",".LINK","","https://raw.githubusercontent.com/mmessano/PowerShell/master/dns-dump.ps1","#\u003e","","    [OutputType('System.Management.Automation.PSCustomObject')]","    [CmdletBinding()]","    Param(","        [Parameter(Position = 0, Mandatory = $True, ValueFromPipelineByPropertyName = $True)]","        [Byte[]]","        $DNSRecord","    )","","    BEGIN {","        Function Get-Name","        {","            [Diagnostics.CodeAnalysis.SuppressMessageAttribute('PSUseOutputTypeCorrectly', '')]","            [CmdletBinding()]","            Param(","                [Byte[]]","                $Raw","            )","","            [Int]$Length = $Raw[0]","            [Int]$Segments = $Raw[1]","            [Int]$Index =  2","            [String]$Name  = ''","","            while ($Segments-- -gt 0)","            {","                [Int]$SegmentLength = $Raw[$Index++]","                while ($SegmentLength-- -gt 0)","                {","                    $Name += [Char]$Raw[$Index++]","                }","                $Name += \".\"","            }","            $Name","        }","    }","","    PROCESS","    {","        # $RDataLen = [BitConverter]::ToUInt16($DNSRecord, 0)","        $RDataType = [BitConverter]::ToUInt16($DNSRecord, 2)","        $UpdatedAtSerial = [BitConverter]::ToUInt32($DNSRecord, 8)","","        $TTLRaw = $DNSRecord[12..15]","","        # reverse for big endian","        $Null = [array]::Reverse($TTLRaw)","        $TTL = [BitConverter]::ToUInt32($TTLRaw, 0)","","        $Age = [BitConverter]::ToUInt32($DNSRecord, 20)","        If ($Age -ne 0)","        {","            $TimeStamp = ((Get-Date -Year 1601 -Month 1 -Day 1 -Hour 0 -Minute 0 -Second 0).AddHours($age)).ToString()","        }","        Else","        {","            $TimeStamp = '[static]'","        }","","        $DNSRecordObject = New-Object PSObject","","        switch ($RDataType)","        {","            1","            {","                $IP = \"{0}.{1}.{2}.{3}\" -f $DNSRecord[24], $DNSRecord[25], $DNSRecord[26], $DNSRecord[27]","                $Data = $IP","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'A'","            }","","            2","            {","                $NSName = Get-Name $DNSRecord[24..$DNSRecord.length]","                $Data = $NSName","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'NS'","            }","","            5","            {","                $Alias = Get-Name $DNSRecord[24..$DNSRecord.length]","                $Data = $Alias","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'CNAME'","            }","","            6","            {","                $PrimaryNS = Get-Name $DNSRecord[44..$DNSRecord.length]","                $ResponsibleParty = Get-Name $DNSRecord[$(46+$DNSRecord[44])..$DNSRecord.length]","                $SerialRaw = $DNSRecord[24..27]","                # reverse for big endian","                $Null = [array]::Reverse($SerialRaw)","                $Serial = [BitConverter]::ToUInt32($SerialRaw, 0)","","                $RefreshRaw = $DNSRecord[28..31]","                $Null = [array]::Reverse($RefreshRaw)","                $Refresh = [BitConverter]::ToUInt32($RefreshRaw, 0)","","                $RetryRaw = $DNSRecord[32..35]","                $Null = [array]::Reverse($RetryRaw)","                $Retry = [BitConverter]::ToUInt32($RetryRaw, 0)","","                $ExpiresRaw = $DNSRecord[36..39]","                $Null = [array]::Reverse($ExpiresRaw)","                $Expires = [BitConverter]::ToUInt32($ExpiresRaw, 0)","","                $MinTTLRaw = $DNSRecord[40..43]","                $Null = [array]::Reverse($MinTTLRaw)","                $MinTTL = [BitConverter]::ToUInt32($MinTTLRaw, 0)","","                $Data = \"[\" + $Serial + \"][\" + $PrimaryNS + \"][\" + $ResponsibleParty + \"][\" + $Refresh + \"][\" + $Retry + \"][\" + $Expires + \"][\" + $MinTTL + \"]\"","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'SOA'","            }","","            12","            {","                $Ptr = Get-Name $DNSRecord[24..$DNSRecord.length]","                $Data = $Ptr","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'PTR'","            }","","            13","            {","                [string]$CPUType = \"\"","                [string]$OSType  = \"\"","                [int]$SegmentLength = $DNSRecord[24]","                $Index = 25","                while ($SegmentLength-- -gt 0)","                {","                    $CPUType += [char]$DNSRecord[$Index++]","                }","                $Index = 24 + $DNSRecord[24] + 1","                [int]$SegmentLength = $Index++","                while ($SegmentLength-- -gt 0)","                {","                    $OSType += [char]$DNSRecord[$Index++]","                }","                $Data = \"[\" + $CPUType + \"][\" + $OSType + \"]\"","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'HINFO'","            }","","            15","            {","                $PriorityRaw = $DNSRecord[24..25]","                # reverse for big endian","                $Null = [array]::Reverse($PriorityRaw)","                $Priority = [BitConverter]::ToUInt16($PriorityRaw, 0)","                $MXHost   = Get-Name $DNSRecord[26..$DNSRecord.length]","                $Data = \"[\" + $Priority + \"][\" + $MXHost + \"]\"","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'MX'","            }","","            16","            {","                [string]$TXT  = ''","                [int]$SegmentLength = $DNSRecord[24]","                $Index = 25","                while ($SegmentLength-- -gt 0)","                {","                    $TXT += [char]$DNSRecord[$Index++]","                }","                $Data = $TXT","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'TXT'","            }","","            28","            {","        \t\t### yeah, this doesn't do all the fancy formatting that can be done for IPv6","                $AAAA = \"\"","                for ($i = 24; $i -lt 40; $i+=2)","                {","                    $BlockRaw = $DNSRecord[$i..$($i+1)]","                    # reverse for big endian","                    $Null = [array]::Reverse($BlockRaw)","                    $Block = [BitConverter]::ToUInt16($BlockRaw, 0)","\t\t\t        $AAAA += ($Block).ToString('x4')","\t\t\t        If ($i -ne 38)","                    {","                        $AAAA += ':'","                    }","                }","                $Data = $AAAA","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'AAAA'","            }","","            33","            {","                $PriorityRaw = $DNSRecord[24..25]","                # reverse for big endian","                $Null = [array]::Reverse($PriorityRaw)","                $Priority = [BitConverter]::ToUInt16($PriorityRaw, 0)","","                $WeightRaw = $DNSRecord[26..27]","                $Null = [array]::Reverse($WeightRaw)","                $Weight = [BitConverter]::ToUInt16($WeightRaw, 0)","","                $PortRaw = $DNSRecord[28..29]","                $Null = [array]::Reverse($PortRaw)","                $Port = [BitConverter]::ToUInt16($PortRaw, 0)","","                $SRVHost = Get-Name $DNSRecord[30..$DNSRecord.length]","                $Data = \"[\" + $Priority + \"][\" + $Weight + \"][\" + $Port + \"][\" + $SRVHost + \"]\"","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'SRV'","            }","","            default","            {","                $Data = $([System.Convert]::ToBase64String($DNSRecord[24..$DNSRecord.length]))","                $DNSRecordObject | Add-Member Noteproperty 'RecordType' 'UNKNOWN'","            }","        }","        $DNSRecordObject | Add-Member Noteproperty 'UpdatedAtSerial' $UpdatedAtSerial","        $DNSRecordObject | Add-Member Noteproperty 'TTL' $TTL","        $DNSRecordObject | Add-Member Noteproperty 'Age' $Age","        $DNSRecordObject | Add-Member Noteproperty 'TimeStamp' $TimeStamp","        $DNSRecordObject | Add-Member Noteproperty 'Data' $Data","        Return $DNSRecordObject","    }","}","","Function Get-ADRDNSZone","{","\u003c#",".SYNOPSIS","    Returns all DNS Zones and Records in the current (or specified) domain.","",".DESCRIPTION","    Returns all DNS Zones and Records in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER ADROutputDir","    [string]","    Path for ADRecon output folder.","",".PARAMETER OutputType","    [array]","    Output Type.","",".PARAMETER ADRDNSZones","    [bool]","",".PARAMETER ADRDNSRecords","    [bool]","",".OUTPUTS","    CSV files are created in the folder specified with the information.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $true)]","        [string] $ADROutputDir,","","        [Parameter(Mandatory = $true)]","        [array] $OutputType,","","        [Parameter(Mandatory = $false)]","        [bool] $ADRDNSZones = $true,","","        [Parameter(Mandatory = $false)]","        [bool] $ADRDNSRecords = $false","    )","","    If ($Method -eq 'ADWS')","