",\"msDS-AllowedToDelegateTo\",\"ms-ds-CreatorSid\",\"msDS-SupportedEncryptionTypes\",\"name\",\"objectsid\",\"operatingsystem\",\"operatingsystemhotfix\",\"operatingsystemservicepack\",\"operatingsystemversion\",\"primarygroupid\",\"pwdlastset\",\"samaccountname\",\"serviceprincipalname\",\"sidhistory\",\"useraccountcontrol\",\"whenchanged\",\"whencreated\"))","            $ObjSearcher.SearchScope = \"Subtree\"","","            Try","            {","                $ADComputers = $ObjSearcher.FindAll()","            }","            Catch","            {","                Write-Warning \"[Get-ADRComputer] Error while enumerating Computer Objects\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                Return $null","            }","            $ObjSearcher.dispose()","        }","","        If ($ADComputers)","        {","            Write-Verbose \"[*] Total Computers: $([ADRecon.LDAPClass]::ObjectCount($ADComputers))\"","            If ($ADRComputers)","            {","                $ComputerObj = [ADRecon.LDAPClass]::ComputerParser($ADComputers, $date, $DormantTimeSpan, $PassMaxAge, $Threads)","            }","            If ($ADRComputerSPNs)","            {","                $ComputerSPNObj = [ADRecon.LDAPClass]::ComputerSPNParser($ADComputers, $Threads)","            }","            Remove-Variable ADComputers","        }","    }","","    If ($ComputerObj)","    {","        Export-ADR -ADRObj $ComputerObj -ADROutputDir $ADROutputDir -OutputType $OutputType -ADRModuleName \"Computers\"","        Remove-Variable ComputerObj","    }","    If ($ComputerSPNObj)","    {","        Export-ADR -ADRObj $ComputerSPNObj -ADROutputDir $ADROutputDir -OutputType $OutputType -ADRModuleName \"ComputerSPNs\"","        Remove-Variable ComputerSPNObj","    }","}","","Function Get-ADRLAPSCheck","{","\u003c#",".SYNOPSIS","    Checks if LAPS (local administrator) is enabled in the current (or specified) domain.","",".DESCRIPTION","    Checks if LAPS (local administrator) is enabled in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomainRootDSE","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".OUTPUTS","    Bool.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomainRootDSE,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADRLAPSCheck = @( Get-ADObject \"CN=ms-Mcs-AdmPwd,$((Get-ADRootDSE).schemaNamingContext)\" )","        }","        Catch","        {","            Write-Verbose \"[*] LAPS is not implemented.\"","            Return $false","        }","","        If ($ADRLAPSCheck)","        {","            Remove-Variable ADRLAPSCheck","            Return $true","        }","        Else","        {","            Return $false","        }","    }","","    If ($Method -eq 'LDAP')","    {","        Try","        {","            If ($Credential -ne [Management.Automation.PSCredential]::Empty)","            {","                $ADRLAPSCheckDSE = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/CN=ms-Mcs-AdmPwd,$($objDomainRootDSE.schemaNamingContext)\", $Credential.UserName, $Credential.GetNetworkCredential().Password","                If (-Not ($ADRLAPSCheckDSE.Path))","                {","                    $ADRLAPSCheck = $false","                }","                Else","                {","                    $ADRLAPSCheck = $true","                    $ADRLAPSCheckDSE.dispose()","                }","            }","            Else","            {","                $ADRLAPSCheck = [ADSI]::Exists(\"LDAP://CN=ms-Mcs-AdmPwd,$($objDomainRootDSE.schemaNamingContext)\")","            }","        }","        Catch","        {","            Write-Verbose \"[Get-ADRLAPSCheck] Error while checking for existance of LAPS Properties\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        If ($ADRLAPSCheck)","        {","            Remove-Variable ADRLAPSCheck","            Return $true","        }","        Else","        {","            Return $false","        }","    }","}","","# based on https://github.com/kfosaaen/Get-LAPSPasswords/blob/master/Get-LAPSPasswords.ps1","Function Get-ADRLAPS","{","\u003c#",".SYNOPSIS","    Returns all LAPS (local administrator) stored passwords in the current (or specified) domain.","",".DESCRIPTION","    Returns all LAPS (local administrator) stored passwords in the current (or specified) domain. Other details such as the Password Expiration, whether the password is readable by the current user are also returned.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","     