$null","    }","}","","Function Get-ADRBitLocker","{","\u003c#",".SYNOPSIS","    Returns all BitLocker Recovery Keys stored in the current (or specified) domain.","",".DESCRIPTION","    Returns all BitLocker Recovery Keys stored in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADBitLockerRecoveryKeys = Get-ADObject -LDAPFilter '(objectClass=msFVE-RecoveryInformation)' -Properties distinguishedName,msFVE-RecoveryPassword,msFVE-RecoveryGuid,msFVE-VolumeGuid,Name,whenCreated","        }","        Catch","        {","            Write-Warning \"[Get-ADRBitLocker] Error while enumerating msFVE-RecoveryInformation Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADBitLockerRecoveryKeys)","        {","            $cnt = $([ADRecon.ADWSClass]::ObjectCount($ADBitLockerRecoveryKeys))","            If ($cnt -ge 1)","            {","                Write-Verbose \"[*] Total BitLocker Recovery Keys: $cnt\"","                $BitLockerObj = @()","                $ADBitLockerRecoveryKeys | ForEach-Object {","                    # Create the object for each instance.","                    $Obj = New-Object PSObject","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Distinguished Name\" -Value $((($_.distinguishedName -split '}')[1]).substring(1))","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Name\" -Value $_.Name","                    $Obj | Add-Member -MemberType NoteProperty -Name \"whenCreated\" -Value $_.whenCreated","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Recovery Key ID\" -Value $([GUID] $_.'msFVE-RecoveryGuid')","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Recovery Key\" -Value $_.'msFVE-RecoveryPassword'","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Volume GUID\" -Value $([GUID] $_.'msFVE-VolumeGuid')","                    Try","                    {","                        $TempComp = Get-ADComputer -Identity $Obj.'Distinguished Name' -Properties msTPM-OwnerInformation,msTPM-TpmInformationForComputer","                    }","                    Catch","                    {","                        Write-Warning \"[Get-ADRBitLocker] Error while enumerating $($Obj.'Distinguished Name') Computer Object\"","                        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                    }","                    If ($TempComp)","                    {","                        # msTPM-OwnerInformation (Vista/7 or Server 2008/R2)","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-OwnerInformation\" -Value $TempComp.'msTPM-OwnerInformation'","","                        # msTPM-TpmInformationForComputer (Windows 8/10 or Server 2012/R2)","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-TpmInformationForComputer\" -Value $TempComp.'msTPM-TpmInformationForComputer'","                        If ($null -ne $TempComp.'msTPM-TpmInformationForComputer')","                        {","                            # Grab the TPM Owner Info from the msTPM-InformationObject","                            $TPMObject = Get-ADObject -Identity $TempComp.'msTPM-TpmInformationForComputer' -Properties msTPM-OwnerInformation","                            $TPMRecoveryInfo = $TPMObject.'msTPM-OwnerInformation'","                        }","                        Else","                        {","                            $TPMRecoveryInfo = $null","                        }","                    }","                    Else","                    {","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-OwnerInformation\" -Value $null","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-TpmInformationForComputer\" -Value $null","                        $TPMRecoveryInfo = $null","","                    }","                    $Obj | Add-Member -MemberType NoteProperty -Name \"TPM Owner Password\" -Value $TPMRecoveryInfo","                    $BitLockerObj += $Obj","                }","            }","            Remove-Variable ADBitLockerRecoveryKeys","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectClass=msFVE-RecoveryInformation)\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedName\",\"msfve-recoverypassword\",\"msfve-recoveryguid\",\"msfve-volumeguid\",\"mstpm-ownerinformation\",\"mstpm-tpminformationforcomputer\",\"name\",\"whencreated\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $ADBitLockerRecoveryKeys = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRBitLocker] Error while enumerating msFVE-RecoveryInformation Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADBitLockerRecoveryKeys)","        {","            $cnt = $([ADRecon.LDAPClass]::ObjectCount($ADBitLockerRecoveryKeys))","            If ($cnt -ge 1)","            {","                Write-Verbose \"[*] Total BitLocker Recovery Keys: $cnt\"","                $BitLockerObj = @()","                $ADBitLockerRecoveryKeys | ForEach-Object {","                    # Create the object for each instance.","                    $Obj = New-Object PSObject","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Distinguished Name\" -Value $((($_.Properties.distinguishedname -split '}')[1]).substring(1))","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Name\" -Value ([string] ($_.Properties.name))","                    $Obj | Add-Member -MemberType NoteProperty -Name \"whenCreated\" -Value ([DateTime] $($_.Properties.whencreated))","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Recovery Key ID\" -Value $([GUID] $_.Properties.'msfve-recoveryguid'[0])","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Recovery Key\" -Value ([string] ($_.Properties.'msfve-recoverypassword'))","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Volume GUID\" -Value $([GUID] $_.Properties.'msfve-volumeguid'[0])","","                    $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","                    $ObjSearcher.PageSize = $PageSize","                    $ObjSearcher.Filter = \"(\u0026(samAccountType=805306369)(distinguishedName=$($Obj.'Distinguished Name')))\"","                    $ObjSearcher.PropertiesToLoad.AddRange((\"mstpm-ownerinformation\",\"mstpm-tpminformationforcomputer\"))","                    $ObjSearcher.SearchScope = \"Subtree\"","","                    Try","                    {","                        $TempComp = $ObjSearcher.FindAll()","                    }","                    Catch","                    {","                        Write-Warning \"[Get-ADRBitLocker] Error while enumerating $($Obj.'Distinguished Name') Computer Object\"","                        Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                    }","                    $ObjSearcher.dispose()","","                    If ($TempComp)","                    {","                        # msTPM-OwnerInformation (Vista/7 or Server 2008/R2)","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-OwnerInformation\" -Value $([string] $TempComp.Properties.'mstpm-ownerinformation')","","                        # msTPM-TpmInformationForComputer (Windows 8/10 or Server 2012/R2)","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-TpmInformationForComputer\" -Value $([string] $TempComp.Properties.'mstpm-tpminformationforcomputer')","                        If ($null -ne $TempComp.Properties.'mstpm-tpminformationforcomputer')","                        {","                            # Grab the TPM Owner Info from the msTPM-InformationObject","                            If ($Credential -ne [Management.Automation.PSCredential]::Empty)","                            {","                                $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$($TempComp.Properties.'mstpm-tpminformationforcomputer')\", $Credential.UserName,$Credential.GetNetworkCredential().Password","                                $objSearcherPath = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","                                $objSearcherPath.PropertiesToLoad.AddRange((\"mstpm-ownerinformation\"))","                                Try","                                {","                                    $TPMObject = $objSearcherPath.FindAll()","                                }","                                Catch","                                {","                                    Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                }","                                $objSearcherPath.dispose()","","                                If ($TPMObject)","                                {","                                    $TPMRecoveryInfo = $([string] $TPMObject.Properties.'mstpm-ownerinformation')","                                }","                                Else","                                {","                                    $TPMRecoveryInfo = $null","                                }","                            }","                            Else","                            {","                                Try","                                {","                                    $TPMObject = ([ADSI]\"LDAP://$($TempComp.Properties.'mstpm-tpminformationforcomputer')\")","                                }","                                Catch","                                {","                                    Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                }","                                If ($TPMObject)","                                {","                                    $TPMRecoveryInfo = $([string] $TPMObject.Properties.'mstpm-ownerinformation')","                                }","                                Else","                                {","                                    $TPMRecoveryInfo = $null","                                }","                            }","                        }","                    }","                    Else","                    {","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-OwnerInformation\" -Value $null","                        $Obj | Add-Member -MemberType NoteProperty -Name \"msTPM-TpmInformationForComputer\" -Value $null","                        $TPMRecoveryInfo = $null","                    }","                    $Obj | Add-Member -MemberType NoteProperty -Name \"TPM Owner Password\" -Value $TPMRecoveryInfo","                    $BitLockerObj += $Obj","                }","            }","            Remove-Variable cnt","            Remove-Variable ADBitLockerRecoveryKeys","        }","    }","","    If ($BitLockerObj)","    {","        Return $BitLockerObj","    }","    Else","    {","        Return $null","    }","}","","# Modified ConvertFrom-SID function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","Function ConvertFrom-SID","{","\u003c#",".SYNOPSIS","    Converts a security identifier (SID) to a group/user name.","","    Author: Will Schroeder (@harmj0y)","    License: BSD 3-Clause","",".DESCRIPTION","    Converts a security identifier string (SID) to a group/user name using IADsNameTranslate interface.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER ObjectSid","    Specifies one or more SIDs to convert.","",".PARAMETER DomainFQDN","    Specifies the FQDN of the Domain.","",".PARAMETER Credential","    Specifies an alternate credential to use for the translation.","",".PARAMETER ResolveSIDs","    [bool]","    Whether to resolve SIDs in the ACLs module. (Default False)","",".EXAMPLE","","    ConvertFrom-SID S-1-5-21-890171859-3433809279-3366196753-1108","","    TESTLAB\\harmj0y","",".EXAMPLE","","    \"S-1-5-21-890171859-3433809279-3366196753-1107\", \"S-1-5-21-890171859-3433809279-3366196753-1108\", \"S-1-5-32-562\" | ConvertFrom-SID","","    TESTLAB\\WINDOWS2$","    TESTLAB\\harmj0y","    BUILTIN\\Distributed COM Users","",".EXAMPLE","","    $SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","    $Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm', $SecPassword)","    ConvertFrom-SID S-1-5-21-890171859-3433809279-3366196753-1108 -Credential $Cred","","    TESTLAB\\harmj0y","",".INPUTS","    [String]","    Accepts one or more SID strings on the pipeline.","",".OUTPUTS","    [String]","    The converted DOMAIN\\username.","#\u003e","    Param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $true)]","        [Alias('SID')]","        #[ValidatePattern('^S-1-.*')]","        [String]","        $ObjectSid,","","        [Parameter(Mandatory = $false)]","        [string] $DomainFQDN,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $false)]","        [bool] $ResolveSID = $false","    )","","    BEGIN {","        # Name Translator Initialization Types","        # https://msdn.microsoft.com/en-us/library/aa772266%28v=vs.85%29.aspx","        $ADS_NAME_INITTYPE_DOMAIN   = 1 # Initializes a NameTranslate object by setting the domain that the object binds to.","        #$ADS_NAME_INITTYPE_SERVER   = 2 # Initializes a NameTranslate object by setting the server that the object binds to.","        $ADS_NAME_INITTYPE_GC       = 3 # Initializes a NameTranslate object by locating the global catalog that the object binds to.","","        # Name Transator Name Types","        # https://msdn.microsoft.com/en-us/library/aa772267%28v=vs.85%29.aspx","        #$ADS_NAME_TYPE_1779                     = 1 # Name format as specified in RFC 1779. For example, \"CN=Jeff Smith,CN=users,DC=Fabrikam,DC=com\".","        #$ADS_NAME_TYPE_CANONICAL                = 2 # Canonical name format. For example, \"Fabrikam.com/Users/Jeff Smith\".","        $ADS_NAME_TYPE_NT4                      = 3 # Account name format used in Windows. For example, \"Fabrikam\\JeffSmith\".","        #$ADS_NAME_TYPE_DISPLAY                  = 4 # Display name format. For example, \"Jeff Smith\".","        #$ADS_NAME_TYPE_DOMAIN_SIMPLE            = 5 # Simple domain name format. For example, \"JeffSmith@Fabrikam.com\".","        #$ADS_NAME_TYPE_ENTERPRISE_SIMPLE        = 6 # Simple enterprise name format. For example, \"JeffSmith@Fabrikam.com\".","        #$ADS_NAME_TYPE_GUID                     = 7 # Global Unique Identifier format. For example, \"{95ee9fff-3436-11d1-b2b0-d15ae3ac8436}\".","        $ADS_NAME_TYPE_UNKNOWN                  = 8 # Unknown name type. The system will estimate the format. This element is a meaningful option only with the IADsNameTranslate.Set or the IADsNameTranslate.SetEx method, but not with the IADsNameTranslate.Get or IADsNameTranslate.GetEx method.","        #$ADS_NAME_TYPE_USER_PRINCIPAL_NAME      = 9 # User principal name format. For example, \"JeffSmith@Fabrikam.com\".","        #$ADS_NAME_TYPE_CANONICAL_EX             = 10 # Extended canonical name format. For example, \"Fabrikam.com/Users Jeff Smith\".","        #$ADS_NAME_TYPE_SERVICE_PRINCIPAL_NAME   = 11 # Service principal name format. For example, \"www/www.fabrikam.com@fabrikam.com\".","        #$ADS_NAME_TYPE_SID_OR_SID_HISTORY_NAME  = 12 # A SID string, as defined in the Security Descriptor Definition Language (SDDL), for either the SID of the current object or one from the object SID history. For example, \"O:AOG:DAD:(A;;RPWPCCDCLCSWRCWDWOGA;;;S-1-0-0)\"","","        # https://msdn.microsoft.com/en-us/library/aa772250.aspx","        #$ADS_CHASE_REFERRALS_NEVER       = (0x00) # The client should never chase the referred-to server. Setting this option prevents a client from contacting other servers in a referral process.","        #$ADS_CHASE_REFERRALS_SUBORDINATE = (0x20) # The client chases only subordinate referrals which are a subordinate naming context in a directory tree. For example, if the base search is requested for \"DC=Fabrikam,DC=Com\", and the server returns a result set and a referral of \"DC=Sales,DC=Fabrikam,DC=Com\" on the AdbSales server, the client can contact the AdbSales server to continue the search. The ADSI LDAP provider always turns off this flag for paged searches.","        #$ADS_CHASE_REFERRALS_EXTERNAL    = (0x40) # The client chases external referrals. For example, a client requests server A to perform a search for \"DC=Fabrikam,DC=Com\". However, server A does not contain the object, but knows that an independent server, B, owns it. It then refers the client to server B.","        $ADS_CHASE_REFERRALS_ALWAYS      = (0x60) # Referrals are chased for either the subordinate or external type.","    }","","    PROCESS {","        $TargetSid = $($ObjectSid.TrimStart(\"O:\"))","        $TargetSid = $($TargetSid.Trim('*'))","        If ($TargetSid -match '^S-1-.*')","        {","            Try","            {","                # try to resolve any built-in SIDs first - https://support.microsoft.com/en-us/kb/243330","                Switch ($TargetSid) {","                    'S-1-0'         { 'Null Authority' }","                    'S-1-0-0'       { 'Nobody' }","                    'S-1-1'         { 'World Authority' }","                    'S-1-1-0'       { 'Everyone' }","                    'S-1-2'         { 'Local Authority' }","                    'S-1-2-0'       { 'Local' }","                    'S-1-2-1'       { 'Console Logon ' }","                    'S-1-3'         { 'Creator Authority' }","                    'S-1-3-0'       { 'Creator Owner' }","                    'S-1-3-1'       { 'Creator Group' }","                    'S-1-3-2'       { 'Creator Owner Server' }","                    'S-1-3-3'       { 'Creator Group Server' }","                    'S-1-3-4'       { 'Owner Rights' }","                    'S-1-4'         { 'Non-unique Authority' }","                    'S-1-5'         { 'NT Authority' }","                    'S-1-5-1'       { 'Dialup' }","                    'S-1-5-2'       { 'Network' }","                    'S-1-5-3'       { 'Batch' }","                    'S-1-5-4'       { 'Interactive' }","                    'S-1-5-6'       { 'Service' }","                    'S-1-5-7'       { 'Anonymous' }","                    'S-1-5-8'       { 'Proxy' }","                    'S-1-5-9'       { 'Enterprise Domain Controllers' }","                    'S-1-5-10'      { 'Principal Self' }","                    'S-1-5-11'      { 'Authenticated Users' }","                    'S-1-5-12'      { 'Restricted Code' }","                    'S-1-5-13'      { 'Terminal Server Users' }","                    'S-1-5-14'      { 'Remote Interactive Logon' }","                    'S-1-5-15'      { 'This Organization ' }","                    'S-1-5-17'      { 'This Organization ' }","                    'S-1-5-18'      { 'Local System' }","                    'S-1-5-19'      { 'NT Authority' }","                    'S-1-5-20'      { 'NT Authority' }","                    'S-1-5-80-0'    { 'All Services ' }","                    'S-1-5-32-544'  { 'BUILTIN\\Administrators' }","                    'S-1-5-32-545'  { 'BUILTIN\\Users' }","                    'S-1-5-32-546'  { 'BUILTIN\\Guests' }","                    'S-1-5-32-547'  { 'BUILTIN\\Power Users' }","                    'S-1-5-32-548'  { 'BUILTIN\\Account Operators' }","                    'S-1-5-32-549'  { 'BUILTIN\\Server Operators' }","                    'S-1-5-32-550'  { 'BUILTIN\\Print Operators' }","                    'S-1-5-32-551'  { 'BUILTIN\\Backup Operators' }","                    'S-1-5-32-552'  { 'BUILTIN\\Replicators' }","                    'S-1-5-32-554'  { 'BUILTIN\\Pre-Windows 2000 Compatible Access' }","                    'S-1-5-32-555'  { 'BUILTIN\\Remote Desktop Users' }","                    'S-1-5-32-556'  { 'BUILTIN\\Network Configuration Operators' }","                    'S-1-5-32-557'  { 'BUILTIN\\Incoming Forest Trust Builders' }","                    'S-1-5-32-558'  { 'BUILTIN\\Performance Monitor Users' }","                    'S-1-5-32-559'  { 'BUILTIN\\Performance Log Users' }","                    'S-1-5-32-560'  { 'BUILTIN\\Windows Authorization Access Group' }","                    'S-1-5-32-561'  { 'BUILTIN\\Terminal Server License Servers' }","                    'S-1-5-32-562'  { 'BUILTIN\\Distributed COM Users' }","                    'S-1-5-32-569'  { 'BUILTIN\\Cryptographic Operators' }","                    'S-1-5-32-573'  { 'BUILTIN\\Event Log Readers' }","                    'S-1-5-32-574'  { 'BUILTIN\\Certificate Service DCOM Access' }","                    'S-1-5-32-575'  { 'BUILTIN\\RDS Remote Access Servers' }","                    'S-1-5-32-576'  { 'BUILTIN\\RDS Endpoint Servers' }","                    'S-1-5-32-577'  { 'BUILTIN\\RDS Management Servers' }","                    'S-1-5-32-578'  { 'BUILTIN\\Hyper-V Administrators' }","                    'S-1-5-32-579'  { 'BUILTIN\\Access Control Assistance Operators' }","                    'S-1-5-32-580'  { 'BUILTIN\\Remote Management Users' }","                    Default {","                        # based on Convert-ADName function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","                        If ( ($TargetSid -match '^S-1-.*') -and ($ResolveSID) )","                        {","                            If ($Method -eq 'ADWS')","                            {","                                Try","                                {","                                    $ADObject = Get-ADObject -Filter \"objectSid -eq '$TargetSid'\" -Properties DistinguishedName,sAMAccountName","                                }","                                Catch","                                {","                                    Write-Warning \"[ConvertFrom-SID] Error while enumerating Object using SID\"","                                    Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                }","                                If ($ADObject)","                                {","                                    $UserDomain = Get-DNtoFQDN -ADObjectDN $ADObject.DistinguishedName","                                    $ADSOutput = $UserDomain + \"\\\" + $ADObject.sAMAccountName","                                    Remove-Variable UserDomain","                                }","                            }","","                            If ($Method -eq 'LDAP')","                            {","                                If ($Credential -ne [Management.Automation.PSCredential]::Empty)","                                {","                                    $ADObject = New-Object System.DirectoryServices.DirectoryEntry(\"LDAP://$DomainFQDN/\u003cSID=$TargetSid\u003e\",($Credential.GetNetworkCredential()).UserName,($Credential.GetNetworkCredential()).Password)","                                }","                                Else","                                {","                                    $ADObject = New-Object System.DirectoryServices.DirectoryEntry(\"LDAP://$DomainFQDN/\u003cSID=$TargetSid\u003e\")","                                }","                                If ($ADObject)","                                {","                                    If (-Not ([string]::IsNullOrEmpty($ADObject.Properties.samaccountname)) )","                                    {","                                        $UserDomain = Get-DNtoFQDN -ADObjectDN $([string] ($ADObject.Properties.distinguishedname))","                                        $ADSOutput = $UserDomain + \"\\\" + $([string] ($ADObject.Properties.samaccountname))","                                        Remove-Variable UserDomain","                                    }","                                }","                            }","","                            If ( (-Not $ADSOutput) -or ([string]::IsNullOrEmpty($ADSOutput)) )","                            {","                                $ADSOutputType = $ADS_NAME_TYPE_NT4","                                $Init = $true","                                $Translate = New-Object -ComObject NameTranslate","                                If ($Credential -ne [Management.Automation.PSCredential]::Empty)","                                {","                                    $ADSInitType = $ADS_NAME_INITTYPE_DOMAIN","                                    Try","                                    {","                                        [System.__ComObject].InvokeMember(\"InitEx\",\"InvokeMethod\",$null,$Translate,$(@($ADSInitType,$DomainFQDN,($Credential.GetNetworkCredential()).UserName,$DomainFQDN,($Credential.GetNetworkCredential()).Password)))","                                    }","                                    Catch","                                    {","                                        $Init = $false","                                        #Write-Verbose \"[ConvertFrom-SID] Error initializing translation for $($TargetSid) using alternate credentials\"","                                        #Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                    }","                                }","                                Else","                                {","                                    $ADSInitType = $ADS_NAME_INITTYPE_GC","                                    Try","                                    {","                                        [System.__ComObject].InvokeMember(\"Init\",\"InvokeMethod\",$null,$Translate,($ADSInitType,$null))","                                    }","                                    Catch","                                    {","                                        $Init = $false","                                        #Write-Verbose \"[ConvertFrom-SID] Error initializing translation for $($TargetSid)\"","                                        #Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                    }","                                }","                                If ($Init)","                                {","                                    [System.__ComObject].InvokeMember(\"ChaseReferral\",\"SetProperty\",$null,$Translate,$ADS_CHASE_REFERRALS_ALWAYS)","                                    Try","                                    {","                                        [System.__ComObject].InvokeMember(\"Set\",\"InvokeMethod\",$null,$Translate,($ADS_NAME_TYPE_UNKNOWN, $TargetSID))","                                        $ADSOutput = [System.__ComObject].InvokeMember(\"Get\",\"InvokeMethod\",$null,$Translate,$ADSOutputType)","                                    }","                                    Catch","                                    {","                                        #Write-Verbose \"[ConvertFrom-SID] Error translating $($TargetSid)\"","                                        #Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","                                    }","                                }","                            }","                        }","                        If (-Not ([string]::IsNullOrEmpty($ADSOutput)) )","                        {","                            Return $ADSOutput","                        }","                        Else","                        {","                            Return $TargetSid","                        }","                    }","                }","            }","            Catch","            {","                #Write-Output \"[ConvertFrom-SID] Error converting SID $($TargetSid)\"","                #Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","        }","        Else","        {","            Return $TargetSid","        }","    }","}","","# based on https://gallery.technet.microsoft.com/Active-Directory-OU-1d09f989","Function Get-ADRACL","{","\u003c#",".SYNOPSIS","    Returns all ACLs for the Domain, OUs, Root Containers, GPO, User, Computer and Group objects in the current (or specified) domain.","",".DESCRIPTION","    Returns all ACLs for the Domain, OUs, Root Containers, GPO, User, Computer and Group objects in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER DomainController","    [string]","    IP Address of the Domain Controller.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".PARAMETER ResolveSIDs","    [bool]","    Whether to resolve SIDs in the ACLs module. (Default False)","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".OUTPUTS","    PSObject.","",".LINK","    https://gallery.technet.microsoft.com/Active-Directory-OU-1d09f989","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [string] $DomainController,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $false)]","        [bool] $ResolveSID = $false,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","        [int] $Threads = 10,","","        [Parameter(Mandatory = $false)]","        [string] $DnBase = $($ADDomain.DistinguishedName)","    )","","    If ($Method -eq 'ADWS')","    {","        If ($Credential -eq [Management.Automation.PSCredential]::Empty)","        {","            If (Test-Path AD:)","            {","                Set-Location AD:","            }","            Else","            {","                Write-Warning \"Default AD drive not found ... Skipping ACL enumeration\"","                Return $null","            }","        }","        $GUIDs = @{'00000000-0000-0000-0000-000000000000' = 'All'}","        Try","        {","            Write-Verbose \"[*] Enumerating schemaIDs\"","            $schemaIDs = Get-ADObject -SearchBase (Get-ADRootDSE).schemaNamingContext -LDAPFilter '(schemaIDGUID=*)' -Properties name, schemaIDGUID","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error while enumerating schemaIDs\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        If ($schemaIDs)","        {","            $schemaIDs | Where-Object {$_} | ForEach-Object {","                # convert the GUID","                $GUIDs[(New-Object Guid (,$_.schemaIDGUID)).Guid] = $_.name","            }","            Remove-Variable schemaIDs","        }","","        Try","        {","            Write-Verbose \"[*] Enumerating Active Directory Rights\"","            $schemaIDs = Get-ADObject -SearchBase \"CN=Extended-Rights,$((Get-ADRootDSE).configurationNamingContext)\" -LDAPFilter '(objectClass=controlAccessRight)' -Properties name, rightsGUID","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error while enumerating Active Directory Rights\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        If ($schemaIDs)","        {","            $schemaIDs | Where-Object {$_} | ForEach-Object {","                # convert the GUID","                $GUIDs[(New-Object Guid (,$_.rightsGUID)).Guid] = $_.name","            }","            Remove-Variable schemaIDs","        }","","        # Get the DistinguishedNames of Domain, OUs, Root Containers and GroupPolicy objects.","        $Objs = @()","        Try","        {","            $ADDomain = Get-ADDomain","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error getting Domain Context\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        Try","        {","            Write-Verbose \"[*] Enumerating Domain, OU, GPO, User, Computer and Group Objects\"","            $Objs += Get-ADObject -SearchBase $DnBase -LDAPFilter '(|(objectClass=domain)(objectCategory=organizationalunit)(objectCategory=groupPolicyContainer)(samAccountType=805306368)(samAccountType=805306369)(samaccounttype=268435456)(samaccounttype=268435457)(samaccounttype=536870912)(samaccounttype=536870913))' -Properties DisplayName, DistinguishedName, Name, ntsecuritydescriptor, ObjectClass, objectsid","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error while enumerating Domain, OU, GPO, User, Computer and Group Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","","        If ($ADDomain)","        {","            Try","            {","                Write-Verbose \"[*] Enumerating Root Container Objects\"","                $Objs += Get-ADObject -SearchBase $($ADDomain.DistinguishedName) -SearchScope OneLevel -LDAPFilter '(objectClass=container)' -Properties DistinguishedName, Name, ntsecuritydescriptor, ObjectClass","            }","            Catch","            {","                Write-Warning \"[Get-ADRACL] Error while enumerating Root Container Objects\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","        }","","        If ($Objs)","        {","            $ACLObj = @()","            Write-Verbose \"[*] Total Objects: $([ADRecon.ADWSClass]::ObjectCount($Objs))\"","            Write-Verbose \"[-] DACLs\"","            $DACLObj = [ADRecon.ADWSClass]::DACLParser($Objs, $GUIDs, $Threads)","            #Write-Verbose \"[-] SACLs - May need a Privileged Account\"","            Write-Warning \"[*] SACLs - Currently, the module is only supported with LDAP.\"","            #$SACLObj = [ADRecon.ADWSClass]::SACLParser($Objs, $GUIDs, $Threads)","            Remove-Variable Objs","            Remove-Variable GUIDs","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $GUIDs = @{'00000000-0000-0000-0000-000000000000' = 'All'}","","        If ($Credential -ne [Management.Automation.PSCredential]::Empty)","        {","            $DomainFQDN = Get-DNtoFQDN($objDomain.distinguishedName)","            $DomainContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext(\"Domain\",$($DomainFQDN),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","            Try","            {","                $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetDomain($DomainContext)","            }","            Catch","            {","                Write-Warning \"[Get-ADRACL] Error getting Domain Context\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","","            Try","            {","                $ForestContext = New-Object System.DirectoryServices.ActiveDirectory.DirectoryContext(\"Forest\",$($ADDomain.Forest),$($Credential.UserName),$($Credential.GetNetworkCredential().password))","                $ADForest = [System.DirectoryServices.ActiveDirectory.Forest]::GetForest($ForestContext)","                $SchemaPath = $ADForest.Schema.Name","                Remove-Variable ADForest","            }","            Catch","            {","                Write-Warning \"[Get-ADRACL] Error enumerating SchemaPath\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","        }","        Else","        {","            $ADDomain = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()","            $ADForest = [System.DirectoryServices.ActiveDirectory.Forest]::GetCurrentForest()","            $SchemaPath = $ADForest.Schema.Name","            Remove-Variable ADForest","        }","","        If ($SchemaPath)","        {","            Write-Verbose \"[*] Enumerating schemaIDs\"","            If ($Credential -ne [Management.Automation.PSCredential]::Empty)","            {","                $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$($SchemaPath)\", $Credential.UserName,$Credential.GetNetworkCredential().Password","                $objSearcherPath = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","            }","            Else","            {","                $objSearcherPath = New-Object System.DirectoryServices.DirectorySearcher ([ADSI] \"LDAP://$($SchemaPath)\")","            }","            $objSearcherPath.PageSize = $PageSize","            $objSearcherPath.filter = \"(schemaIDGUID=*)\"","","            Try","            {","                $SchemaSearcher = $objSearcherPath.FindAll()","            }","            Catch","            {","                Write-Warning \"[Get-ADRACL] Error enumerating SchemaIDs\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","","            If ($SchemaSearcher)","            {","                $SchemaSearcher | Where-Object {$_} | ForEach-Object {","                    # convert the GUID","                    $GUIDs[(New-Object Guid (,$_.properties.schemaidguid[0])).Guid] = $_.properties.name[0]","                }","                $SchemaSearcher.dispose()","            }","            $objSearcherPath.dispose()","","            Write-Verbose \"[*] Enumerating Active Directory Rights\"","            If ($Credential -ne [Management.Automation.PSCredential]::Empty)","            {","                $objSearchPath = New-Object System.DirectoryServices.DirectoryEntry \"LDAP://$($DomainController)/$($SchemaPath.replace(\"Schema\",\"Extended-Rights\"))\", $Credential.UserName,$Credential.GetNetworkCredential().Password","                $objSearcherPath = New-Object System.DirectoryServices.DirectorySearcher $objSearchPath","            }","            Else","            {","                $objSearcherPath = New-Object System.DirectoryServices.DirectorySearcher ([ADSI] \"LDAP://$($SchemaPath.replace(\"Schema\",\"Extended-Rights\"))\")","            }","            $objSearcherPath.PageSize = $PageSize","            $objSearcherPath.filter = \"(objectClass=controlAccessRight)\"","","            Try","            {","                $RightsSearcher = $objSearcherPath.FindAll()","            }","            Catch","            {","                Write-Warning \"[Get-ADRACL] Error enumerating Active Directory Rights\"","                Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            }","","            If ($RightsSearcher)","            {","                $RightsSearcher | Where-Object {$_} | ForEach-Object {","                    # convert the GUID","                    $GUIDs[$_.properties.rightsguid[0].toString()] = $_.properties.name[0]","                }","                $RightsSearcher.dispose()","            }","            $objSearcherPath.dispose()","        }","","        # Get the Domain, OUs, Root Containers, GPO, User, Computer and Group objects.","        $Objs = @()","        Write-Verbose \"[*] Enumerating Domain, OU, GPO, User, Computer and Group Objects\"","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $objSearcherPath.SearchRoot = \"LDAP://$DnBase\"","        $ObjSearcher.Filter = \"(|(objectClass=domain)(objectCategory=organizationalunit)(objectCategory=groupPolicyContainer)(samAccountType=805306368)(samAccountType=805306369)(samaccounttype=268435456)(samaccounttype=268435457)(samaccounttype=536870912)(samaccounttype=536870913))\"","        # https://msdn.microsoft.com/en-us/library/system.directoryservices.securitymasks(v=vs.110).aspx","        $ObjSearcher.SecurityMasks = [System.DirectoryServices.SecurityMasks]::Dacl -bor [System.DirectoryServices.SecurityMasks]::Group -bor [System.DirectoryServices.SecurityMasks]::Owner -bor [System.DirectoryServices.SecurityMasks]::Sacl","        $ObjSearcher.PropertiesToLoad.AddRange((\"displayname\",\"distinguishedname\",\"name\",\"ntsecuritydescriptor\",\"objectclass\",\"objectsid\"))","        $ObjSearcher.SearchScope = \"Subtree\"","","        Try","        {","            $Objs += $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error while enumerating Domain, OU, GPO, User, Computer and Group Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","        $ObjSearcher.dispose()","","        Write-Verbose \"[*] Enumerating Root Container Objects\"","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(objectClass=container)\"","        # https://msdn.microsoft.com/en-us/library/system.directoryservices.securitymasks(v=vs.110).aspx","        $ObjSearcher.SecurityMasks = $ObjSearcher.SecurityMasks = [System.DirectoryServices.SecurityMasks]::Dacl -bor [System.DirectoryServices.SecurityMasks]::Group -bor [System.DirectoryServices.SecurityMasks]::Owner -bor [System.DirectoryServices.SecurityMasks]::Sacl","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"name\",\"ntsecuritydescriptor\",\"objectclass\"))","        $ObjSearcher.SearchScope = \"OneLevel\"","","        Try","        {","            $Objs += $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRACL] Error while enumerating Root Container Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","        $ObjSearcher.dispose()","","        If ($Objs)","        {","            Write-Verbose \"[*] Total Objects: $([ADRecon.LDAPClass]::ObjectCount($Objs))\"","            Write-Verbose \"[-] DACLs\"","            $DACLObj = [ADRecon.LDAPClass]::DACLParser($Objs, $GUIDs, $Threads)","            Write-Verbose \"[-] SACLs - May need a Privileged Account\"","            $SACLObj = [ADRecon.LDAPClass]::SACLParser($Objs, $GUIDs, $Threads)","            Remove-Variable Objs","            Remove-Variable GUIDs","        }","    }","","    If ($DACLObj)","    {","        Export-ADR $DACLObj $ADROutputDir $OutputType \"DACLs\"","        Remove-Variable DACLObj","    }","","    If ($SACLObj)","    {","        Export-ADR $SACLObj $ADROutputDir $OutputType \"SACLs\"","        Remove-Variable SACLObj","    }","}","","Function Get-ADRGPOReport","{","\u003c#",".SYNOPSIS","    Runs the Get-GPOReport cmdlet if available.","",".DESCRIPTION","    Runs the Get-GPOReport cmdlet if available and saves in HTML and XML formats.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER UseAltCreds","    [bool]","    Whether to use provided credentials or not.","",".PARAMETER ADROutputDir","    [string]","    Path for ADRecon output folder.","",".OUTPUTS","    HTML and XML GPOReports are created in the folder specified.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $true)]","        [bool] $UseAltCreds,","","        [Parameter(Mandatory = $true)]","        [string] $ADROutputDir","    )","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            # Suppress verbose output on module import","            $SaveVerbosePreference = $script:VerbosePreference","            $script:VerbosePreference = 'SilentlyContinue'","","            If ($PSVersionTable.PSEdition -eq \"Core\")","            {","                Import-Module GroupPolicy -SkipEditionCheck -WarningAction Stop -ErrorAction Stop | Out-Null","            }","            Else","            {","                Import-Module GroupPolicy -WarningAction Stop -ErrorAction Stop | Out-Null","            }","            If ($SaveVerbosePreference)","            {","                $script:VerbosePreference = $SaveVerbosePreference","                Remove-Variable SaveVerbosePreference","            }","        }","        Catch","        {","            Write-Warning \"[Get-ADRGPOReport] Error importing the GroupPolicy Module. Skipping GPOReport\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            If ($SaveVerbosePreference)","            {","                $script:VerbosePreference = $SaveVerbosePreference","                Remove-Variable SaveVerbosePreference","            }","            Return $null","        }","        Try","        {","            Write-Verbose \"[*] GPOReport XML\"","            $ADFileName = -join($ADROutputDir,'\\','GPO-Report','.xml')","            Get-GPOReport -All -ReportType XML -Path $ADFileName","        }","        Catch","        {","            If ($UseAltCreds)","            {","                Write-Warning \"[*] Run the tool using RUNAS.\"","                Write-Warning \"[*] runas /user:\u003cDomain FQDN\u003e\\\u003cUsername\u003e /netonly powershell.exe\"","                Return $null","            }","            Write-Warning \"[Get-ADRGPOReport] Error getting the GPOReport in XML\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","        Try","        {","            Write-Verbose \"[*] GPOReport HTML\"","            $ADFileName = -join($ADROutputDir,'\\','GPO-Report','.html')","            Get-GPOReport -All -ReportType HTML -Path $ADFileName","        }","        Catch","        {","            If ($UseAltCreds)","            {","                Write-Warning \"[*] Run the tool using RUNAS.\"","                Write-Warning \"[*] runas /user:\u003cDomain FQDN\u003e\\\u003cUsername\u003e /netonly powershell.exe\"","                Return $null","            }","            Write-Warning \"[Get-ADRGPOReport] Error getting the GPOReport in XML\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","        }","    }","    If ($Method -eq 'LDAP')","    {","        Write-Warning \"[*] Currently, the module is only supported with ADWS.\"","    }","}","","# Modified Invoke-UserImpersonation function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","Function Get-ADRUserImpersonation","{","\u003c#",".SYNOPSIS","","Creates a new \"runas /netonly\" type logon and impersonates the token.","","Author: Will Schroeder (@harmj0y)","License: BSD 3-Clause","Required Dependencies: PSReflect","",".DESCRIPTION","","This function uses LogonUser() with the LOGON32_LOGON_NEW_CREDENTIALS LogonType","to simulate \"runas /netonly\". The resulting token is then impersonated with","ImpersonateLoggedOnUser() and the token handle is returned for later usage","with Invoke-RevertToSelf.","",".PARAMETER Credential","","A [Management.Automation.PSCredential] object with alternate credentials","to impersonate in the current thread space.","",".PARAMETER TokenHandle","","An IntPtr TokenHandle returned by a previous Invoke-UserImpersonation.","If this is supplied, LogonUser() is skipped and only ImpersonateLoggedOnUser()","is executed.","",".PARAMETER Quiet","","Suppress any warnings about STA vs MTA.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","Invoke-UserImpersonation -Credential $Cred","",".OUTPUTS","","IntPtr","","The TokenHandle result from LogonUser.","#\u003e","","    [OutputType([IntPtr])]","    [CmdletBinding(DefaultParameterSetName = 'Credential')]","    Param(","        [Parameter(Mandatory = $True, ParameterSetName = 'Credential')]","        [Management.Automation.PSCredential]","        [Management.Automation.CredentialAttribute()]","        $Credential,","","        [Parameter(Mandatory = $True, ParameterSetName = 'TokenHandle')]","        [ValidateNotNull()]","        [IntPtr]","        $TokenHandle,","","        [Switch]","        $Quiet","    )","","    If (([System.Threading.Thread]::CurrentThread.GetApartmentState() -ne 'STA') -and (-not $PSBoundParameters['Quiet']))","    {","        Write-Warning \"[Get-ADRUserImpersonation] powershell.exe process is not currently in a single-threaded apartment state, token impersonation may not work.\"","    }","","    If ($PSBoundParameters['TokenHandle'])","    {","        $LogonTokenHandle = $TokenHandle","    }","    Else","    {","        $LogonTokenHandle = [IntPtr]::Zero","        $NetworkCredential = $Credential.GetNetworkCredential()","        $UserDomain = $NetworkCredential.Domain","        If (-Not $UserDomain)","        {","            Write-Warning \"[Get-ADRUserImpersonation] Use credential with Domain FQDN. (\u003cDomain FQDN\u003e\\\u003cUsername\u003e)\"","        }","        $UserName = $NetworkCredential.UserName","        Write-Warning \"[Get-ADRUserImpersonation] Executing LogonUser() with user: $($UserDomain)\\$($UserName)\"","","        # LOGON32_LOGON_NEW_CREDENTIALS = 9, LOGON32_PROVIDER_WINNT50 = 3","        #   this is to simulate \"runas.exe /netonly\" functionality","        $Result = $Advapi32::LogonUser($UserName, $UserDomain, $NetworkCredential.Password, 9, 3, [ref]$LogonTokenHandle)","        $LastError = [System.Runtime.InteropServices.Marshal]::GetLastWin32Error();","","        If (-not $Result)","        {","            throw \"[Get-ADRUserImpersonation] LogonUser() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","        }","    }","","    # actually impersonate the token from LogonUser()","    $Result = $Advapi32::ImpersonateLoggedOnUser($LogonTokenHandle)","","    If (-not $Result)","    {","        throw \"[Get-ADRUserImpersonation] ImpersonateLoggedOnUser() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","    }","","    Write-Verbose \"[Get-ADR-UserImpersonation] Alternate credentials successfully impersonated\"","    $LogonTokenHandle","}","","# Modified Invoke-RevertToSelf function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","Function Get-ADRRevertToSelf","{","\u003c#",".SYNOPSIS","","Reverts any token impersonation.","","Author: Will Schroeder (@harmj0y)","License: BSD 3-Clause","Required Dependencies: PSReflect","",".DESCRIPTION","","This function uses RevertToSelf() to revert any impersonated tokens.","If -TokenHandle is passed (the token handle returned by Invoke-UserImpersonation),","CloseHandle() is used to close the opened handle.","",".PARAMETER TokenHandle","","An optional IntPtr TokenHandle returned by Invoke-UserImpersonation.","",".EXAMPLE","","$SecPassword = ConvertTo-SecureString 'Password123!' -AsPlainText -Force","$Cred = New-Object System.Management.Automation.PSCredential('TESTLAB\\dfm.a', $SecPassword)","$Token = Invoke-UserImpersonation -Credential $Cred","Invoke-RevertToSelf -TokenHandle $Token","#\u003e","","    [CmdletBinding()]","    Param(","        [ValidateNotNull()]","        [IntPtr]","        $TokenHandle","    )","","    If ($PSBoundParameters['TokenHandle'])","    {","        Write-Warning \"[Get-ADRRevertToSelf] Reverting token impersonation and closing LogonUser() token handle\"","        $Result = $Kernel32::CloseHandle($TokenHandle)","    }","","    $Result = $Advapi32::RevertToSelf()","    $LastError = [System.Runtime.InteropServices.Marshal]::GetLastWin32Error();","","    If (-not $Result)","    {","        Write-Error \"[Get-ADRRevertToSelf] RevertToSelf() Error: $(([ComponentModel.Win32Exception] $LastError).Message)\"","    }","","    Write-Verbose \"[Get-ADRRevertToSelf] Token impersonation successfully reverted\"","}","","# Modified Get-DomainSPNTicket function from https://github.com/PowerShellMafia/PowerSploit/blob/dev/Recon/PowerView.ps1","Function Get-ADRSPNTicket","{","\u003c#","\u003c#",".SYNOPSIS","    Request the kerberos ticket for a specified service principal name (SPN).","","    Author: machosec, Will Schroeder (@harmj0y)","    License: BSD 3-Clause","    Required Dependencies: Invoke-UserImpersonation, Invoke-RevertToSelf","",".DESCRIPTION","    This function will either take one SPN strings, and will request a kerberos ticket for the given SPN using System.IdentityModel.Tokens.KerberosRequestorSecurityToken. The encrypted portion of the ticket is then extracted and output in either crackable Hashcat format.","",".PARAMETER UserSPN","    [string]","    Service Principal Name.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $UserSPN","    )","","    Try","    {","        $Null = [Reflection.Assembly]::LoadWithPartialName('System.IdentityModel')","        $Ticket = New-Object System.IdentityModel.Tokens.KerberosRequestorSecurityToken -ArgumentList $UserSPN","    }","    Catch","    {","        Write-Warning \"[Get-ADRSPNTicket] Error requesting ticket for SPN $UserSPN\"","        Write-Warning \"[EXCEPTION] $($_.Exception.Message)\"","        Return $null","    }","","    If ($Ticket)","    {","        $TicketByteStream = $Ticket.GetRequest()","    }","","    If ($TicketByteStream)","    {","        $TicketHexStream = [System.BitConverter]::ToString($TicketByteStream) -replace '-'","","        # TicketHexStream == GSS-API Frame (see https://tools.ietf.org/html/rfc4121#section-4.1)","        # No easy way to parse ASN1, so we'll try some janky regex to parse the embedded KRB_AP_REQ.Ticket object","        If ($TicketHexStream -match 'a382....3082....A0030201(?\u003cEtypeLen\u003e..)A1.{1,4}.......A282(?\u003cCipherTextLen\u003e....)........(?\u003cDataToEnd\u003e.+)')","        {","            $Etype = [Convert]::ToByte( $Matches.EtypeLen, 16 )","            $CipherTextLen = [Convert]::ToUInt32($Matches.CipherTextLen, 16)-4","            $CipherText = $Matches.DataToEnd.Substring(0,$CipherTextLen*2)","","            # Make sure the next field matches the beginning of the KRB_AP_REQ.Authenticator object","            If ($Matches.DataToEnd.Substring($CipherTextLen*2, 4) -ne 'A482')","            {","                Write-Warning '[Get-ADRSPNTicket] Error parsing ciphertext for the SPN  $($Ticket.ServicePrincipalName).' # Use the TicketByteHexStream field and extract the hash offline with Get-KerberoastHashFromAPReq","                $Hash = $null","            }","            Else","            {","                $Hash = \"$($CipherText.Substring(0,32))`$$($CipherText.Substring(32))\"","            }","        }","        Else","        {","            Write-Warning \"[Get-ADRSPNTicket] Unable to parse ticket structure for the SPN  $($Ticket.ServicePrincipalName).\" # Use the TicketByteHexStream field and extract the hash offline with Get-KerberoastHashFromAPReq","            $Hash = $null","        }","    }","    $Obj = New-Object PSObject","    $Obj | Add-Member -MemberType NoteProperty -Name \"ServicePrincipalName\" -Value $Ticket.ServicePrincipalName","    $Obj | Add-Member -MemberType NoteProperty -Name \"Etype\" -Value $Etype","    $Obj | Add-Member -MemberType NoteProperty -Name \"Hash\" -Value $Hash","    Return $Obj","}","","Function Get-ADRKerberoast","{","\u003c#",".SYNOPSIS","    Returns all user service principal name (SPN) hashes in the current (or specified) domain.","",".DESCRIPTION","    Returns all user service principal name (SPN) hashes in the current (or specified) domain.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER Credential","    [Management.Automation.PSCredential]","    Credentials.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize","    )","","    If ($Credential -ne [Management.Automation.PSCredential]::Empty)","    {","        $LogonToken = Get-ADRUserImpersonation -Credential $Credential","    }","","    If ($Method -eq 'ADWS')","    {","        Try","        {","            $ADUsers = Get-ADObject -LDAPFilter \"(\u0026(!objectClass=computer)(servicePrincipalName=*)(!userAccountControl:1.2.840.113556.1.4.803:=2))\" -Properties sAMAccountName,servicePrincipalName,DistinguishedName -ResultPageSize $PageSize","        }","        Catch","        {","            Write-Warning \"[Get-ADRKerberoast] Error while enumerating UserSPN Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","","        If ($ADUsers)","        {","            $UserSPNObj = @()","            $ADUsers | ForEach-Object {","                ForEach ($UserSPN in $_.servicePrincipalName)","                {","                    $Obj = New-Object PSObject","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Username\" -Value $_.sAMAccountName","                    $Obj | Add-Member -MemberType NoteProperty -Name \"ServicePrincipalName\" -Value $UserSPN","","                    $HashObj = Get-ADRSPNTicket $UserSPN","                    If ($HashObj)","                    {","                        $UserDomain = $_.DistinguishedName.SubString($_.DistinguishedName.IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        # JohnTheRipper output format","                        $JTRHash = \"`$krb5tgs`$$($HashObj.ServicePrincipalName):$($HashObj.Hash)\"","                        # hashcat output format","                        $HashcatHash = \"`$krb5tgs`$$($HashObj.Etype)`$*$($_.SamAccountName)`$$UserDomain`$$($HashObj.ServicePrincipalName)*`$$($HashObj.Hash)\"","                    }","                    Else","                    {","                        $JTRHash = $null","                        $HashcatHash = $null","                    }","                    $Obj | Add-Member -MemberType NoteProperty -Name \"John\" -Value $JTRHash","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Hashcat\" -Value $HashcatHash","                    $UserSPNObj += $Obj","                }","            }","            Remove-Variable ADUsers","        }","    }","","    If ($Method -eq 'LDAP')","    {","        $objSearcher = New-Object System.DirectoryServices.DirectorySearcher $objDomain","        $ObjSearcher.PageSize = $PageSize","        $ObjSearcher.Filter = \"(\u0026(!objectClass=computer)(servicePrincipalName=*)(!userAccountControl:1.2.840.113556.1.4.803:=2))\"","        $ObjSearcher.PropertiesToLoad.AddRange((\"distinguishedname\",\"samaccountname\",\"serviceprincipalname\",\"useraccountcontrol\"))","        $ObjSearcher.SearchScope = \"Subtree\"","        Try","        {","            $ADUsers = $ObjSearcher.FindAll()","        }","        Catch","        {","            Write-Warning \"[Get-ADRKerberoast] Error while enumerating UserSPN Objects\"","            Write-Verbose \"[EXCEPTION] $($_.Exception.Message)\"","            Return $null","        }","        $ObjSearcher.dispose()","","        If ($ADUsers)","        {","            $UserSPNObj = @()","            $ADUsers | ForEach-Object {","                ForEach ($UserSPN in $_.Properties.serviceprincipalname)","                {","                    $Obj = New-Object PSObject","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Username\" -Value $_.Properties.samaccountname[0]","                    $Obj | Add-Member -MemberType NoteProperty -Name \"ServicePrincipalName\" -Value $UserSPN","","                    $HashObj = Get-ADRSPNTicket $UserSPN","                    If ($HashObj)","                    {","                        $UserDomain = $_.Properties.distinguishedname[0].SubString($_.Properties.distinguishedname[0].IndexOf('DC=')) -replace 'DC=','' -replace ',','.'","                        # JohnTheRipper output format","                        $JTRHash = \"`$krb5tgs`$$($HashObj.ServicePrincipalName):$($HashObj.Hash)\"","                        # hashcat output format","                        $HashcatHash = \"`$krb5tgs`$$($HashObj.Etype)`$*$($_.Properties.samaccountname)`$$UserDomain`$$($HashObj.ServicePrincipalName)*`$$($HashObj.Hash)\"","                    }","                    Else","                    {","                        $JTRHash = $null","                        $HashcatHash = $null","                    }","                    $Obj | Add-Member -MemberType NoteProperty -Name \"John\" -Value $JTRHash","                    $Obj | Add-Member -MemberType NoteProperty -Name \"Hashcat\" -Value $HashcatHash","                    $UserSPNObj += $Obj","                }","            }","            Remove-Variable ADUsers","        }","    }","","    If ($LogonToken)","    {","        Get-ADRRevertToSelf -TokenHandle $LogonToken","    }","","    If ($UserSPNObj)","    {","        Return $UserSPNObj","    }","    Else","    {","        Return $null","    }","}","","# based on https://gallery.technet.microsoft.com/scriptcenter/PowerShell-script-to-find-6fc15ecb","Function Get-ADRDomainAccountsusedforServiceLogon","{","\u003c#",".SYNOPSIS","    Returns all accounts used by services on computers in an Active Directory domain.","",".DESCRIPTION","    Retrieves a list of all computers in the current domain and reads service configuration using Get-WmiObject.","",".PARAMETER Method","    [string]","    Which method to use; ADWS (default), LDAP.","",".PARAMETER objDomain","    [DirectoryServices.DirectoryEntry]","    Domain Directory Entry object.","",".PARAMETER PageSize","    [int]","    The PageSize to set for the LDAP searcher object. Default 200.","",".PARAMETER Threads","    [int]","    The number of threads to use during processing of objects. Default 10.","",".OUTPUTS","    PSObject.","#\u003e","    param(","        [Parameter(Mandatory = $true)]","        [string] $Method,","","        [Parameter(Mandatory = $false)]","        [DirectoryServices.DirectoryEntry] $objDomain,","","        [Parameter(Mandatory = $false)]","        [Management.Automation.PSCredential] $Credential = [Management.Automation.PSCredential]::Empty,","","        [Parameter(Mandatory = $true)]","        [int] $PageSize = 200,","","        [Parameter(Mandatory = $false)]","        [int] $Threads = 10","    )","","    BEGIN {","        $readServiceAccounts = [scriptblock] {","            # scriptblock to retrieve service list form a remove machine","            $hostname = [string] $args[0]","            $OperatingSystem = [string] $args[1]","            #$Credential = [Management.Automation.PSCredential] $args[2]","            $Credential = $args[2]","            $timeout = 250","            $port = 135","            Try","            {","                $tcpclient = New-Object System.Net.Sockets.TcpClient","                $result = $tcpclient.BeginConnect($hostname,$port,$null,$null)","                $success = $result.AsyncWaitHandle.WaitOne($timeout,$null)","            }","            Catch","            {","                $warning = \"$hostname ($OperatingSystem) is unreachable $($_.Exception.Message)\"","                $success = $false","                $tcpclient.Close()","            }","            If ($success)","            {","                # PowerShellv2 does not support New-CimSession","                If ($PSVersionTable.PSVersion.Major -ne 2)","                {","                    If ($Credential -ne [Management.Automation.PSCredential]::Empty)","                    {","                        $session = New-CimSession -ComputerName $hostname -SessionOption $(New-CimSessionOption -Protocol DCOM) -Credential $Credential","                        If ($session)","                        {","                            $serviceList = @( Get-CimInstance -ClassName Win32_Service -Property Name,StartName,SystemName -CimSession $session -ErrorAction Stop)","                        }","                    }","                    Else","                    {","                        $session = New-CimSession -ComputerName $hostname -SessionOption $(New-CimSessionOption -Protocol DCOM)","                        If ($session)","                        {","                            $serviceList = @( Get-CimInstance -ClassName Win32_Service -Property Name,StartName,SystemName -CimSession $session -ErrorAction Stop )","                        }","                    }","                }","                Else","                {","                    If ($Credential -ne [Management.Automation.PSCredential]::Empty)","                    {","                        $serviceList = @( Get-WmiObject -Class Win32_Service -ComputerName $hostname -Credential $Credential -Impersonation 3 -Property Name,StartName,SystemName -ErrorAction Stop )","                    }","                    Else","                    {","                        $serviceList = @( Get-WmiObject -Class Win32_Service -ComputerName $hostname -Property Name,StartName,SystemName -ErrorAction Stop )","                    }","                }","                $serviceList","            }","            Try","            {","                If ($tcpclient) { $tcpclient.EndConnect($result) | Out-Null }","            }","            Catch","            {","                $warning = \"$hostname ($OperatingSystem) : $($_.Exception.Message)\"","            }","            $warning","        }","","        Function processCompletedJobs()","        {","            # reads service list from completed jobs,","            # updates $serviceAccount table and removes completed job","","            $jobs = Get-Job -State Completed","            ForEach( $job in $jobs )","            {","                If ($null -ne $job)","                {","                    $data = Receive-Job $job","                    Remove-Job $job","                }","","                If ($data)","                {","                    If ( $data.GetType() -eq [Object[]] )","                    {","                        $serviceList = $data | Where-Object { if ($_.StartName) { $_ }}","                        $serviceList | ForEach-Object {","                            $Obj = New-Object PSObject","                            $Obj | Add-Member -MemberType NoteProperty -Name \"Account\" -Value $_.StartName","                            $Obj | Add-Member -MemberType NoteProperty -Name \"Service Name\" -Value $_.Name","                            $Obj | Add-Member -MemberType NoteProperty -Name \"SystemName\" -Value $_.SystemName","                            If ($_.StartName.toUpper().Contains($currentDomain))","                            {","                                $Obj | Add-Member -MemberType NoteProperty -Name \"Running as Domain User\" -Value $true","                            }","                            Else","                            {","                                $Obj | Add-Member -MemberType NoteProperty -Name \"Running as Domain User\" -Value $false","                            }","                            $script:serviceAccounts += $Obj","                        }","                    }","                    ElseIf ( $data.GetType() -eq [String] )","                    {","                        $script:warnings += $data","                        Write-Verbose $data","                    }","                }","            }","        }","    }","","    PROCESS","    {","        $script:serviceAccounts = @()","        [string[]] $warnings = @()","        If ($Method -eq 'ADWS')","        {","